111NX0100X	111NX0100X	Chiropractic Providers	Chiropractor	Occupational Health	Occupational Health is that specialty within the chiropractic profession that deals with the prevention and management of work related injuries. It also considers and assists clients with State and Federal Compliance assistance. Occupational Health goes much farther than simply treating injured workers however. This may mean working with clients to promote optimum safety and ergonomic principles, interacting with the injured worker to promote safety and prevent future injuries, assisting a company with accident investigation to identify root cause, redesigning a workstation to eliminate hazards, working with safety teams, providing training programs etc. The list of potential services that the specialist can interact with a client company or patient is lengthy and varied involving both in office services as well as on site services.	Source: American Chiropractic Association, 2008 [7/1/2009: title modified, definition added]	\N	\N	\N	metaTaxonomyCode:111NX0100X	\N	\N	\N	\N	\N	f
111NX0800X	111NX0800X	Chiropractic Providers	Chiropractor	Orthopedic	Chiropractic Orthopedics is defined as that branch of chiropractic medicine that includes the continued acquisition of knowledge relative to both normal functions and diseases of the human body as they relate to the bones, joints, capsules, discs, muscles, ligaments, tendons, their complete neurological and vascular components, referred organ systems and contiguous tissues. This also includes the development and perfection of skills relative to health maintenance when such exists and when not, the investigations, historical review, physical detection, correlative diagnosis development and complete management of any disorder within the bounds defined herein. Also necessary is the delivery of the combined knowledge and skill on a primary basis to patients who both need and desire this service to the eventual outcome of remissions, whenever resolution is not readily achievable. In addition the certified chiropractic orthopedist provides consultation services at the request of other qualified doctors seeking assistance in the care of their patients. The chiropractic orthopedist may also engage in the teaching and or research of subjects and materials relevant to pursuing the quest for knowledge in the ever changing field of the orthopedic specialty.	Source: American Chiropractic Association, 2008 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:111NX0800X	\N	\N	\N	\N	\N	f
