171M00000X	171M00000X	Other Service Providers	Case Manager/Care Coordinator	\N	A person who provides case management services and assists an individual in gaining access to needed medical, social, educational, and/or other services.  The person has the ability to provide an assessment and review of completed plan of care on a periodic basis.  This person is also able to take collaborative action to coordinate the services with other providers and monitor the enrollee’s progress toward the cost-effective achievement of objectives specified in the plan of care.  Credentials may vary from an experience in the fields of psychology, social work, rehabilitation, nursing or a closely related human service field, to a related Assoc of Arts Degree or to nursing credentials.  Some states may require certification in case management.	Source: CMS State Medicaid Manual Section 4442.3  [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:171M00000X	\N	\N	\N	\N	\N	f
171R00000X	171R00000X	Other Service Providers	Interpreter	\N	An Interpreter is a person who translates oral communication between two or more people.  This includes translating from one language to another or interpreting sign language.  An interpreter is necessary for medical care when the patient does not speak the language of the health care provider or when the patient has a disability involving spoken language.	Source:  National Medicaid EDI HIPAA NPI Sub Work Group [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:171R00000X	\N	\N	\N	\N	\N	f
171W00000X	171W00000X	Other Service Providers	Contractor	\N	A person who contracts to supply certain materials or do certain work for a stipulated sum; esp., one whose business is contracting work in any of the building trades. For purposes of the taxonomy, a person who contracts to complete home repairs or modifications to accommodate a health condition (e.g. wheelchair ramp, kitchen counter lowering).	Source: Websters New World Dictionary of the American Language, Second College Edition, William Collins + World Publishing Co., Inc., New York: 1974, p. 308	\N	\N	\N	metaTaxonomyCode:171W00000X	\N	\N	\N	\N	\N	f
