176P00000X	176P00000X	Other Service Providers	Funeral Director	\N	A person, usually an embalmer, whose business is to arrange for the burial or cremation of the dead and to assist at the funeral rites.	Source: Joint Commission on Accreditation of Healthcare Organizations, Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, Oakbrook Terrace, IL: 1994, p. 323	\N	\N	\N	metaTaxonomyCode:176P00000X	\N	\N	\N	\N	\N	f
