183500000X	183500000X	Pharmacy Service Providers	Pharmacist	\N	An individual licensed by the appropriate state regulatory agency to engage in the practice of pharmacy.  The practice of pharmacy includes, but is not limited to, assessment, interpretation, evaluation, and implementation, initiation, monitoring or modification of medication and or medical orders; the compounding or dispensing of medication and or medical orders; participation in drug and device procurement, storage, and selection; drug administration; drug regimen reviews; drug or drug-related research; provision of patient education and the provision of those acts or services necessary to provide medication therapy management services in all areas of patient care.	Source: Adapted from National Association of Boards of Pharmacy Model State Pharmacy Act, Article 1, Section 104. [1/1/2006: definition modified, source modified]	\N	\N	\N	metaTaxonomyCode:183500000X	\N	\N	\N	\N	\N	f
1835C0205X	1835C0205X	Pharmacy Service Providers	Pharmacist	Critical Care	A licensed pharmacist who has demonstrated specialized knowledge and skill in the delivery of patient care services by pharmacists, as integral members of interprofessional teams, working to ensure the safe and effective use of medications in critically ill patients.	Source: Board of Pharmacy Specialties, www.bpsweb.org  [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:1835C0205X	\N	\N	\N	\N	\N	f
