1835G0303X	1835G0303X	Pharmacy Service Providers	Pharmacist	Geriatric	A pharmacist who is certified in geriatric pharmacy practice is designated as a “Certified Geriatric Pharmacist” (CGP).  To become certified, candidates are expected to be knowledgeable about principles of geriatric pharmacotherapy and the provision of pharmaceutical care to the elderly.	Source:  Commission for Certification in Geriatric Pharmacy (www.ccgp.org) [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:1835G0303X	\N	\N	\N	\N	\N	f
1835N0905X	1835N0905X	Pharmacy Service Providers	Pharmacist	Nuclear	A licensed pharmacist who has demonstrated specialized knowledge and skill in procurement, compounding, quality control testing, dispensing, distribution, and monitoring of radiopharmaceuticals.	Source:  Specialty certification and recertification program administered by Board of Pharmaceutical Specialties, www.bpsweb.org [7/1/2006: modified title, added definition]	\N	\N	\N	metaTaxonomyCode:1835N0905X	\N	\N	\N	\N	\N	f
1835N1003X	1835N1003X	Pharmacy Service Providers	Pharmacist	Nutrition Support	A licensed pharmacist who has demonstrated specialized knowledge and skill in maintenance and/or restoration of optimal nutritional status, designing and modifying treatment according to patient needs.	Source:  Specialty certification and recertification program administered by Board of Pharmaceutical Specialties, www.bpsweb.org [7/1/2006: definition modified]	\N	\N	\N	metaTaxonomyCode:1835N1003X	\N	\N	\N	\N	\N	f
1835P0018X	1835P0018X	Pharmacy Service Providers	Pharmacist	Pharmacist Clinician (PhC)/ Clinical Pharmacy Specialist	Pharmacist Clinician/Clinical Pharmacy Specialist is a pharmacist with additional training and an expanded scope of practice that may include prescriptive authority, therapeutic management, and disease management.	Source: National Uniform Claim Committee, 2007 [1/1/2008: new]	\N	\N	\N	metaTaxonomyCode:1835P0018X	\N	\N	\N	\N	\N	f
1835P0200X	1835P0200X	Pharmacy Service Providers	Pharmacist	Pediatrics	A licensed pharmacist who has demonstrated specialized knowledge and skill in the delivery of patient care services by pharmacists that ensures the safe and effective use of medications for all children from neonates through adolescents.	Source: Board of Pharmacy Specialties, www.bpsweb.org   [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:1835P0200X	\N	\N	\N	\N	\N	f
1835P1200X	1835P1200X	Pharmacy Service Providers	Pharmacist	Pharmacotherapy	A licensed pharmacist who has demonstrated specialized knowledge and skill in optimizing pharmacotherapeutic care of patients, by developing, implementing, monitoring, and modifying complex treatment plans, providing advanced level education and consultation, and collaborating with other health professionals in the management of therapy.	Source:  Specialty certification and recertification program administered by Board of Pharmaceutical Specialties, www.bpsweb.org [7/1/2006: modified definition]	\N	\N	\N	metaTaxonomyCode:1835P1200X	\N	\N	\N	\N	\N	f
1835P1300X	1835P1300X	Pharmacy Service Providers	Pharmacist	Psychiatric	A licensed pharmacist who has demonstrated specialized knowledge and skill in optimizing care of patients with psychiatric illness by assessing and monitoring patients, recognizing drug-induced problems, and recommending appropriate treatment plans.	Source:  Specialty certification and recertification program administered by Board of Pharmaceutical Specialties, www.bpsweb.org [7/1/2006: modified title, added definition]	\N	\N	\N	metaTaxonomyCode:1835P1300X	\N	\N	\N	\N	\N	f
1835P2201X	1835P2201X	Pharmacy Service Providers	Pharmacist	Ambulatory Care	A licensed pharmacist who has demonstrated specialized knowledge and skill in the provision of integrated, accessible health care services by pharmacists and is accountable for addressing medication needs, developing sustained partnerships with patients, and practicing in the context of family and community.	Source:  Board of Pharmacy Specialties, www.bpsweb.org   [7/1/2015: new]	\N	\N	\N	metaTaxonomyCode:1835P2201X	\N	\N	\N	\N	\N	f
1835X0200X	1835X0200X	Pharmacy Service Providers	Pharmacist	Oncology	A licensed pharmacist who has demonstrated specialized knowledge and skill in developing, recommending, implementing, monitoring, and modifying pharmacotherapeutic plans to optimize outcomes in patients with malignant diseases.	Source:  Specialty certification and recertification program administered by Board of Pharmaceutical Specialties, www.bpsweb.org [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:1835X0200X	\N	\N	\N	\N	\N	f
183700000X	183700000X	Pharmacy Service Providers	Pharmacy Technician	\N	A person who works under the direct supervision of a licensed pharmacist and performs many pharmacy-related functions that do not require the professional judgment of a pharmacist.	Source: Pharmacy Technician Certification Board, www.ptcb.org [1/1/2006: modified definition, modified source]	\N	\N	\N	metaTaxonomyCode:183700000X	\N	\N	\N	\N	\N	f
193200000X	193200000X	Group	Multi-Specialty	\N	A business group of one or more individual practitioners, who practice with different areas of specialization.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:193200000X	\N	\N	\N	\N	\N	f
193400000X	193400000X	Group	Single Specialty	\N	A business group of one or more individual practitioners, all of who practice with the same area of specialization.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:193400000X	\N	\N	\N	\N	\N	f
202K00000X	202K00000X	Allopathic & Osteopathic Physicians	Phlebology	\N	Phlebology is the medical discipline that involves the diagnosis and treatment of venous disorders, including spider veins, varicose veins, chronic venous insufficiency, venous leg ulcers, congenital venous abnormalities, venous thromboembolism and other disorders of venous origin.   A phlebologist has attained a minimum of 50 hours of CME units in phlebology-related courses, and is knowledgeable of and trained in a variety of diagnostic techniques including physical examination, venous imaging techniques such as duplex ultrasound, CT and MR, plethysmographic techniques and laboratory evaluation related to venous thromboembolism.  The phlebologist is also trained in a variety of therapeutic interventions, which may include compression, sclerotherapy, cutaneous vascular laser, endovenous thermoablation procedures (laser and radiofrequency) endovenous chemical ablation, surgical procedures (e.g., ambulatory phlebectomy, venous ligation), vasoactive medications and the management of venous thromboembolism.	Source: American College of Phlebology 12/2006. [1/1/2007: new, 7/1/2009: definition reformatted]    Additional Resources: Training Programs, Fellowships, and/or Preceptorships: Certification exam is being established by the American Board of Phlebology. ACGME Accredited Residency Program Requirements: None	\N	\N	\N	metaTaxonomyCode:202K00000X	\N	\N	\N	\N	\N	f
204C00000X	204C00000X	Allopathic & Osteopathic Physicians	Neuromusculoskeletal Medicine, Sports Medicine	\N	Definition to come.	\N	\N	\N	\N	metaTaxonomyCode:204C00000X	\N	\N	\N	\N	\N	f
204D00000X	204D00000X	Allopathic & Osteopathic Physicians	Neuromusculoskeletal Medicine & OMM	\N	The Neuromusculoskeletal Medicine and Osteopathic Manipulative Medicine physician directs special attention to the neuromusculoskeletal system and its interaction with other body systems. Neuromusculoskeletal Medicine and Osteopathic Manipulative Medicine encompasses increased knowledge and understanding of osteopathic principles and practice and heightened technical skills of osteopathic manipulative medicine, and integrates each of these into the management of pediatric, adolescent, adult, and geriatric patients.	Source: American Osteopathic Association, 2017 [7/1/2017: added definition]<br/><br/>Additional Resources: American Osteopathic Board of Neuromusculoskeletal Medicine, 2017, http://www.osteopathic.org/certification	\N	\N	\N	metaTaxonomyCode:204D00000X	\N	\N	\N	\N	\N	f
204E00000X	204E00000X	Allopathic & Osteopathic Physicians	Oral & Maxillofacial Surgery	\N	Oral and maxillofacial surgeons are trained to recognize and treat a wide spectrum of diseases, injuries and defects in the head, neck, face, jaws and the hard and soft tissues of the oral and maxillofacial region. They are also trained to administer anesthesia, and provide care in an office setting. They are trained to treat problems such as the extraction of wisdom teeth, misaligned jaws, tumors and cysts of the jaw and mouth, and to perform dental implant surgery.	 Source: American College of Surgeons, 2013. [7/1/2013: definition added, source added, additional resources added]    Additional Resources: American Board of Oral and Maxillofacial Surgery and American Association of Oral and Maxillofacial Surgeons    While this is generally considered a specialty of dentistry, physicians can also be board certified as oral and maxillofacial surgeons through the American Board of Oral and Maxillofacial Surgery.	\N	\N	\N	metaTaxonomyCode:204E00000X	\N	\N	\N	\N	\N	f
204F00000X	204F00000X	Allopathic & Osteopathic Physicians	Transplant Surgery	\N	Definition to come.	\N	\N	\N	\N	metaTaxonomyCode:204F00000X	\N	\N	\N	\N	\N	f
204R00000X	204R00000X	Allopathic & Osteopathic Physicians	Electrodiagnostic Medicine	\N	Electrodiagnostic medicine is the medical subspecialty that applies neurophysiologic techniques to diagnose, evaluate, and treat patients with impairments of the neurologic, neuromuscular, and/or muscular systems.  Qualified physicians are trained in performing electrophysiological testing and interpretation of the test data.  They require knowledge in anatomy, physiology, kinesiology, histology, and pathology of the brain, spinal cord, autonomic nerves, cranial nerves, peripheral nerves, neuromuscular junction, and muscles. They must know clinical features and treatment of diseases of the central, peripheral, and autonomic nervous systems, as well as those of neuromuscular junction and muscle. Physicians also require special knowledge about electric signal processing, including waveform analysis, electronics and instrumentation, stimulation and recording equipment, and statistics.	Source: American Association of Neuromuscular & Electrodiagnostic Medicine, 2011. www.aanem.org [1/1/2011: new]  Additional Resources:  American Board of Electrodiagnostic Medicine, 2011.  www.abemexam.org	\N	\N	\N	metaTaxonomyCode:204R00000X	\N	\N	\N	\N	\N	f
207K00000X	207K00000X	Allopathic & Osteopathic Physicians	Allergy & Immunology	\N	An allergist-immunologist is trained in evaluation, physical and laboratory diagnosis, and management of disorders involving the immune system. Selected examples of such conditions include asthma, anaphylaxis, rhinitis, eczema, and adverse reactions to drugs, foods, and insect stings as well as immune deficiency diseases (both acquired and congenital), defects in host defense, and problems related to autoimmune disease, organ transplantation, or malignancies of the immune system.	Source: American Board of Medical Specialties, 2007, www.abms.org  [7/1/2007: added definition, added source]  Additional Resources: American Board of Allergy and Immunology, 2007.  http://www.abai.org/   No subspecialty certificates in allergy and immunology are offered by the American Board of Allergy and Immunology (ABAI). The ABAI, however, does offer formal special pathways for physicians seeking dual certification in allergy/immunology and pediatric pulmonology; allergy/immunology and pediatric rheumatology; and allergy/immunology and adult rheumatology.	\N	\N	\N	metaTaxonomyCode:207K00000X	\N	\N	\N	\N	\N	f
