207L00000X	207L00000X	Allopathic & Osteopathic Physicians	Anesthesiology	\N	An anesthesiologist is trained to provide pain relief and maintenance, or restoration, of a stable condition during and immediately following an operation or an obstetric or diagnostic procedure. The anesthesiologist assesses the risk of the patient undergoing surgery and optimizes the patient's condition prior to, during and after surgery. In addition to these management responsibilities, the anesthesiologist provides medical management and consultation in pain management and critical care medicine. Anesthesiologists diagnose and treat acute, long-standing and cancer pain problems; diagnose and treat patients with critical illnesses or severe injuries; direct resuscitation in the care of patients with cardiac or respiratory emergencies, including the need for artificial ventilation; and supervise post-anesthesia recovery.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007:  added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Anesthesiology, 2007.  http://www.theaba.org/; American Osteopathic Board of Anesthesiology, 2007, http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Anesthesiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Anesthesiology.	\N	\N	\N	metaTaxonomyCode:207L00000X	\N	\N	\N	\N	\N	f
207LA0401X	207LA0401X	Allopathic & Osteopathic Physicians	Anesthesiology	Addiction Medicine	An anesthesiologist who specializes in the diagnosis and treatment of addictions.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A Certification of Added Qualifications (CAQ) was, but is no longer issued by the American Osteopathic Board of Anesthesiology. 	\N	\N	\N	metaTaxonomyCode:207LA0401X	\N	\N	\N	\N	\N	f
207LC0200X	207LC0200X	Allopathic & Osteopathic Physicians	Anesthesiology	Critical Care Medicine	An anesthesiologist, who specializes in critical care medicine diagnoses, treats and supports patients with multiple organ dysfunction. This specialist may have administrative responsibilities for intensive care units and may also facilitate and coordinate patient care among the primary physician, the critical care staff and other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007:  added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Anesthesiology, 2007.  http://www.theaba.org/; American Osteopathic Board of Anesthesiology, 2007, http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Anesthesiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Anesthesiology.	\N	\N	\N	metaTaxonomyCode:207LC0200X	\N	\N	\N	\N	\N	f
207LH0002X	207LH0002X	Allopathic & Osteopathic Physicians	Anesthesiology	Hospice and Palliative Medicine	An anesthesiologist with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:207LH0002X	\N	\N	\N	\N	\N	f
207LP2900X	207LP2900X	Allopathic & Osteopathic Physicians	Anesthesiology	Pain Medicine	An anesthesiologist who provides a high level of care, either as a primary physician or consultant, for patients experiencing problems with acute, chronic and/or cancer pain in both hospital and ambulatory settings. Patient care needs are also coordinated with other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007:  added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Anesthesiology, 2007.  http://www.theaba.org/; American Osteopathic Board of Anesthesiology, 2007, http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Anesthesiology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Anesthesiology.	\N	\N	\N	metaTaxonomyCode:207LP2900X	\N	\N	\N	\N	\N	f
207LP3000X	207LP3000X	Allopathic & Osteopathic Physicians	Anesthesiology	Pediatric Anesthesiology	An anesthesiologist who has had additional skill and experience in and is primarily concerned with the anesthesia, sedation, and pain management needs of infants and children.  A pediatric anesthesiologist generally provides services including the evaluation of complex medical problems in infants and children when surgery is necessary,  planning and care for children before and after surgery, pain control, anesthesia and sedation for any procedures out of the operating room such as MRI, CT scan, and radiation therapy.	Source: American Academy of Pediatrics [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:207LP3000X	\N	\N	\N	\N	\N	f
207N00000X	207N00000X	Allopathic & Osteopathic Physicians	Dermatology	\N	A dermatologist is trained to diagnose and treat pediatric and adult patients with benign and malignant disorders of the skin, mouth, external genitalia, hair and nails, as well as a number of sexually transmitted diseases. The dermatologist has had additional training and experience in the diagnosis and treatment of skin cancers, melanomas, moles and other tumors of the skin, the management of contact dermatitis and other allergic and nonallergic skin disorders, and in the recognition of the skin manifestations of systemic (including internal malignancy) and infectious diseases. Dermatologists have special training in dermatopathology and in the surgical techniques used in dermatology. They also have expertise in the management of cosmetic disorders of the skin such as hair loss and scars and the skin changes associated with aging.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source]    Additional Resources: American Board of Dermatology, 2007.  http://www.abderm.org/    Board certification is provided by the American Board of Dermatology.   	\N	\N	\N	metaTaxonomyCode:207N00000X	\N	\N	\N	\N	\N	f
207ND0101X	207ND0101X	Allopathic & Osteopathic Physicians	Dermatology	MOHS-Micrographic Surgery	The highly-trained surgeons that perform Mohs Micrographic Surgery are specialists both in dermatology and pathology. With their extensive knowledge of the skin and unique pathological skills, they are able to remove only diseased tissue, preserving healthy tissue and minimizing the cosmetic impact of the surgery.  Mohs surgeons who belong to the American College of Mohs Surgery (ACMS) have completed a minimum of one year of fellowship training at one of the ACMS-approved training centers in the U.S.	Source: American College of Mohs Surgery, 2007 [1/1/2008: added definition, added source]  Additional Resources: Additional Resources: http://www.mohscollege.org/; American Board of Dermatology, 2007.  http://www.abderm.org/	\N	\N	\N	metaTaxonomyCode:207ND0101X	\N	\N	\N	\N	\N	f
207NI0002X	207NI0002X	Allopathic & Osteopathic Physicians	Dermatology	Clinical & Laboratory Dermatological Immunology	A dermatologist who utilizes various specialized laboratory procedures to diagnose disorders characterized by defective responses of the body's immune system. Immunodermatologists also may provide consultation in the management of these disorders and administer specialized forms of therapy for these diseases.	Source: American Board of Medical Specialties, 2007.  www.abms.org  [7/1/2007: added definition, added source]    Additional Resources: American Board of Dermatology, 2007.  http://www.abderm.org/    Board certification is provided by the American Board of Dermatology.  	\N	\N	\N	metaTaxonomyCode:207NI0002X	\N	\N	\N	\N	\N	f
207NP0225X	207NP0225X	Allopathic & Osteopathic Physicians	Dermatology	Pediatric Dermatology	A pediatric dermatologist has, through additional special training, developed expertise in the treatment of specific skin disease categories with emphasis on those diseases which predominate in infants, children and adolescents.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: changed definition, added source]    Additional Resources: American Board of Dermatology, 2007, http://www.abderm.org/  A subspecialty certificate was approved by ABMS in 2000.    ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:207NP0225X	\N	\N	\N	\N	\N	f
207NS0135X	207NS0135X	Allopathic & Osteopathic Physicians	Dermatology	Procedural Dermatology	Procedural Dermatology, a subspecialty of Dermatology, encompassing a wide variety of surgical procedures and methods to remove or modify skin tissue for health or cosmetic benefit. These methods include scalpel surgery, laser surgery, chemical surgery, cryosurgery (liquid nitrogen), electrosurgery, aspiration surgery, liposuction, injection of filler substances, and Mohs micrographic controlled surgery (a special technique for the removal of growths, especially skin cancers).	Source: American Board of Dermatology, 2007 [1/1/2008: definition added, source added, title changed]    Additional Resources:  Some ABMS board certified dermatologists have completed a one-year ACGME approved fellowship in Procedural Dermatology, which has been offered since 2003. At this time the ABD does not offer subspecialty certification in Procedural Dermatology. 	\N	\N	\N	metaTaxonomyCode:207NS0135X	\N	\N	\N	\N	\N	f
207P00000X	207P00000X	Allopathic & Osteopathic Physicians	Emergency Medicine	\N	An emergency physician focuses on the immediate decision making and action necessary to prevent death or any further disability both in the pre-hospital setting by directing emergency medical technicians and in the emergency department. The emergency physician provides immediate recognition, evaluation, care, stabilization and disposition of a generally diversified population of adult and pediatric patients in response to acute illness and injury.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: mofified source]<br/><br/>Additional Resources: American Board of Emergency Medicine, 2007.  http://www.abem.org/public/; American Osteopathic Board of Emergency Medicine, 2007. http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Emergency Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Emergency Medicine.	\N	\N	\N	metaTaxonomyCode:207P00000X	\N	\N	\N	\N	\N	f
207PE0004X	207PE0004X	Allopathic & Osteopathic Physicians	Emergency Medicine	Emergency Medical Services	An emergency medicine physician who specializes in non-hospital based emergency medical services (e.g., disaster site, accident scene, transport vehicle, etc.) to provide pre-hospital assessment, treatment, and transport patients.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A Certification of Added Qualifications (CAQ) is issued by the American Osteopathic Board of Emergency Medicine.	\N	\N	\N	metaTaxonomyCode:207PE0004X	\N	\N	\N	\N	\N	f
207PE0005X	207PE0005X	Allopathic & Osteopathic Physicians	Emergency Medicine	Undersea and Hyperbaric Medicine	A specialist who treats decompression illness and diving accident cases and uses hyperbaric oxygen therapy to treat such conditions as carbon monoxide poisoning, gas gangrene, non-healing wounds, tissue damage from radiation and burns, and bone infections.  This specialist also serves as a consultant to other physicians in all aspects of hyperbaric chamber operations, and assesses risks and applies appropriate standards to prevent disease and disability in divers and other persons working in altered atmospheric conditions.	Source: American Board of Emergency Medicine [7/1/2008: source added, additional resources added]    Additional Resources: Additional Resources: www.abem.org & American Board of Preventive Medicine www.abprevmed.org	\N	\N	\N	metaTaxonomyCode:207PE0005X	\N	\N	\N	\N	\N	f
207PH0002X	207PH0002X	Allopathic & Osteopathic Physicians	Emergency Medicine	Hospice and Palliative Medicine	An emergency medicine physician with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:207PH0002X	\N	\N	\N	\N	\N	f
207PP0204X	207PP0204X	Allopathic & Osteopathic Physicians	Emergency Medicine	Pediatric Emergency Medicine	Pediatric Emergency Medicine is a clinical subspecialty that focuses on the care of the acutely ill or injured child in the setting of an emergency department.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source]  Additional Resources: American Board of Emergency Medicine, 2007.  http://www.abem.org/public/    Board certification is provided by the American Board of Emergency Medicine.  Board certification for Medical Doctors (MDs) is provided by the American Board of Emergency Medicine.  	\N	\N	\N	metaTaxonomyCode:207PP0204X	\N	\N	\N	\N	\N	f
207RH0000X	207RH0000X	Allopathic & Osteopathic Physicians	Internal Medicine	Hematology	An internist with additional training who specializes in diseases of the blood, spleen and lymph. This specialist treats conditions such as anemia, clotting disorders, sickle cell disease, hemophilia, leukemia and lymphoma.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Internal Medicine, 2007.  http://www.abim.org/.  American Osteopathic Board of Internal Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Internal  Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Internal  Medicine.	\N	\N	\N	metaTaxonomyCode:207RH0000X	\N	\N	\N	\N	\N	f
207PS0010X	207PS0010X	Allopathic & Osteopathic Physicians	Emergency Medicine	Sports Medicine	An emergency physician with special knowledge in sports medicine is responsible for continuous care in the field of sports medicine, not only for the enhancement of health and fitness, but also for the prevention and management of injury and illness. A sports medicine physician has knowledge and experience in the promotion of wellness and the role of exercise in promoting a healthy lifestyle. Knowledge of exercise physiology, biomechanics, nutrition, psychology, physical rehabilitation and epidemiology is essential to the practice of sports medicine.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Emergency Medicine, 2007.  http://www.abem.org/public/.   American Osteopathic Board of Emergency Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Emergency Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Emergency Medicine.	\N	\N	\N	metaTaxonomyCode:207PS0010X	\N	\N	\N	\N	\N	f
207PT0002X	207PT0002X	Allopathic & Osteopathic Physicians	Emergency Medicine	Medical Toxicology	Medical toxicologists are physicians who specialize in the prevention, evaluation, treatment and monitoring of injury and illness from exposures to drugs and chemicals, as well as biological and radiological agents. Medical toxicologists care for people in clinical, academic, governmental and public health settings, and provide poison control center leadership. Important areas of medical toxicology include acute drug poisoning, adverse drug events, drug abuse, addiction and withdrawal, chemicals and hazardous materials, terrorism preparedness, venomous bites and stings and environmental and workplace exposures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Emergency Medicine, 2007.  http://www.abem.org/public/.   American Osteopathic Board of Emergency Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Emergency Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Emergency Medicine.	\N	\N	\N	metaTaxonomyCode:207PT0002X	\N	\N	\N	\N	\N	f
207Q00000X	207Q00000X	Allopathic & Osteopathic Physicians	Family Medicine	\N	Family Medicine is the medical specialty which is concerned with the total health care of the individual and the family. It is the specialty in breadth which integrates the biological, clinical, and behavioral sciences. The scope of family medicine is not limited by age, sex, organ system, or disease entity.	Source:  American Board of Family Medicine [1/1/2007: changed title; 7/1/2007: added definition, added source; 7/1/2017: modified definition]<br/><br/>Note:  The American Osteopathic Board of Family Physicians certification includes extensive use of Osteopathic Manipulative Treatment (OMT), which integrates the biological, clinical, and behavioral sciences. <br/><br/>Additional Resources:  American Board of Family Medicine, www.theabfm.org.  American Osteopathic Board of Family Physicians, www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Family Medicine. Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Family Physicians or the American Board of Family Medicine.	\N	\N	\N	metaTaxonomyCode:207Q00000X	\N	\N	\N	\N	\N	f
207QA0000X	207QA0000X	Allopathic & Osteopathic Physicians	Family Medicine	Adolescent Medicine	A family medicine physician with multidisciplinary training in the unique physical, psychological and social characteristics of adolescents and their health care problems and needs.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: added definition, added source; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Family Medicine, 2007.  http://www.theabfm.org/.  American Osteopathic Board of Family Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Family Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Family Medicine.	\N	\N	\N	metaTaxonomyCode:207QA0000X	\N	\N	\N	\N	\N	f
