207SM0001X	207SM0001X	Allopathic & Osteopathic Physicians	Medical Genetics	Molecular Genetic Pathology	A board certified subspecialty, the molecular genetic pathologist is expert in the principles, theory and technologies of molecular biology and molecular genetics. This expertise is used to make or confirm diagnoses of Mendelian genetic disorders, of human development, infectious diseases and malignancies and to assess the natural history of those disorders. A molecular genetic pathologist provides information about gene structure, function and alteration, and applies laboratory techniques for diagnosis, treatment and prognosis for individuals with related disorders.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Medical Genetics, 2007.  http://www.abmg.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Medical Genetics.    A subspecialty certificate for MGG was approved by the ABMS in 1999.    ACGME Accredited Residency Program Requirements:  Proposal under development.	\N	\N	\N	metaTaxonomyCode:207SM0001X	\N	\N	\N	\N	\N	f
207T00000X	207T00000X	Allopathic & Osteopathic Physicians	Neurological Surgery	\N	A neurological surgeon provides the operative and non-operative management (i.e., prevention, diagnosis, evaluation, treatment, critical care, and rehabilitation) of disorders of the central, peripheral, and autonomic nervous systems, including their supporting structures and vascular supply; the evaluation and treatment of pathological processes which modify function or activity of the nervous system; and the operative and non-operative management of pain. A neurological surgeon treats patients with disorders of the nervous system; disorders of the brain, meninges, skull, and their blood supply, including the extracranial carotid and vertebral arteries; disorders of the pituitary gland; disorders of the spinal cord, meninges, and vertebral column, including those which may require treatment by spinal fusion or instrumentation; and disorders of the cranial and spinal nerves throughout their distribution.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Neurological Surgery, 2007.  http://www.abns.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Neurological Surgery.	\N	\N	\N	metaTaxonomyCode:207T00000X	\N	\N	\N	\N	\N	f
207U00000X	207U00000X	Allopathic & Osteopathic Physicians	Nuclear Medicine	\N	A nuclear medicine specialist employs the properties of radioactive atoms and molecules in the diagnosis and treatment of disease and in research. Radiation detection and imaging instrument systems are used to detect disease as it changes the function and metabolism of normal cells, tissues and organs. A wide variety of diseases can be found in this way, usually before the structure of the organ involved by the disease can be seen to be abnormal by any other techniques. Early detection of coronary artery disease (including acute heart attack), early cancer detection and evaluation of the effect of tumor treatment, diagnosis of infection and inflammation anywhere in the body and early detection of blood clot in the lungs are all possible with these techniques. Unique forms of radioactive molecules can attack and kill cancer cells (e.g., lymphoma, thyroid cancer) or can relieve the severe pain of cancer that has spread to bone	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Nuclear Medicine, 2007.  http://www.abnm.org/.    A doctor of osteopathy was able to obtain a Certificate of Added Qualifications in the field of Nuclear Medicine.  The Certificate is NO longer offered.<br/><br/>American Osteopathic Board of Nuclear Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Nuclear Medicine.	\N	\N	\N	metaTaxonomyCode:207U00000X	\N	\N	\N	\N	\N	f
