207VX0201X	207VX0201X	Allopathic & Osteopathic Physicians	Obstetrics & Gynecology	Gynecologic Oncology	An obstetrician/gynecologist who provides consultation and comprehensive management of patients with gynecologic cancer, including those diagnostic and therapeutic procedures necessary for the total care of the patient with gynecologic cancer and resulting complications.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Obstetrics and Gynecology, 2007.  http://www.abog.org/.  American Osteopathic Board of Obstetrics and Gynecology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Obstetrics and Gynecology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Obstetrics and Gynecology.	\N	\N	\N	metaTaxonomyCode:207VX0201X	\N	\N	\N	\N	\N	f
207W00000X	207W00000X	Allopathic & Osteopathic Physicians	Ophthalmology	\N	An ophthalmologist has the knowledge and professional skills needed to provide comprehensive eye and vision care. Ophthalmologists are medically trained to diagnose, monitor and medically or surgically treat all ocular and visual disorders. This includes problems affecting the eye and its component structures, the eyelids, the orbit and the visual pathways. In so doing, an ophthalmologist prescribes vision services, including glasses and contact lenses.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Ophthalmology, 2007.  http://www.abop.org/.  American Osteopathic Board of Ophthalmology and Otolaryngology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Ophthalmology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Ophthalmology and Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207W00000X	\N	\N	\N	\N	\N	f
261QG0250X	261QG0250X	Ambulatory Health Care Facilities	Clinic/Center	Genetics	An entity, facility, or distinct part of a facility providing analysis of family history, genetic laboratory testing and analysis, diagnosis of genetic trait, prognosis and options.  Laboratory studies may be outsourced.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:261QG0250X	\N	\N	\N	\N	\N	f
207WX0009X	207WX0009X	Allopathic & Osteopathic Physicians	Ophthalmology	Glaucoma Specialist	An ophthalmologist who specializes in the treatment of glaucoma and other disorders related to increased intraocular pressure and optic nerve damage.  This specialty involves the medical and surgical treatment of these conditions.	Source: American Academy of Ophthalmology, www.aao.org [1/1/2017: new]  Additional Resources: Association of University Professors of Ophthalmology, www.aupo.org	\N	\N	\N	metaTaxonomyCode:207WX0009X	\N	\N	\N	\N	\N	f
207WX0107X	207WX0107X	Allopathic & Osteopathic Physicians	Ophthalmology	Retina Specialist	An ophthalmologist who specializes in the diagnosis and treatment of vitreoretinal diseases.	Source: American Society of Retina Specialists, www.asrs.org [1/1/2017: new]<br/><br/>Additional Resources: American Academy of Ophthalmology, www.aao.org.  Macula Society, www.maculasociety.org.  Retina Society, www.retinasociety.org.  Association of University Professors of Ophthalmology, www.aupo.org.	\N	\N	\N	metaTaxonomyCode:207WX0107X	\N	\N	\N	\N	\N	f
207WX0108X	207WX0108X	Allopathic & Osteopathic Physicians	Ophthalmology	Uveitis and Ocular Inflammatory Disease	An ophthalmologist who specializes in the treatment of intraocular inflammation, scleritis, keratitis and infectious disorders affecting the eye and inflammatory disorders of the adnexa and/or orbit.	Source: American Academy of Ophthalmology, www.aao.org [1/1/2017: new]<br/><br/>Additional Resources: Association of University Professors of Ophthalmology, www.aupo.org	\N	\N	\N	metaTaxonomyCode:207WX0108X	\N	\N	\N	\N	\N	f
207WX0109X	207WX0109X	Allopathic & Osteopathic Physicians	Ophthalmology	Neuro-ophthalmology	A neuro-ophthalmologist is a subspecialist of ophthalmology.  This physician evaluates, treats, and studies disorders of the eye, orbit and nervous system having to do with interactions of the visual motor and visual sensory systems with the central nervous system. Neuro-ophthalmologists manage patients with complex and severe neuro-ophthalmological disorders.	Source: American Academy of Ophthalmology, www.aao.org [7/1/2017: new]	\N	\N	\N	metaTaxonomyCode:207WX0109X	\N	\N	\N	\N	\N	f
207WX0110X	207WX0110X	Allopathic & Osteopathic Physicians	Ophthalmology	Pediatric Ophthalmology and Strabismus Specialist	An ophthalmologist who specializes in pediatric ophthalmology and strabismus management. The subspecialty includes the medical and surgical management of eye disorders found in children. Some of the more common disorders include amblyopia, strabismus, refractive error, cataract and glaucoma. These disorders may be related to neurological and endocrinological diseases, trauma, or aging changes in the extraocular muscles requiring medical, optical and surgical management.	Source: American Academy of Ophthalmology, www.aao.org [7/1/2017: new]	\N	\N	\N	metaTaxonomyCode:207WX0110X	\N	\N	\N	\N	\N	f
207WX0200X	207WX0200X	Allopathic & Osteopathic Physicians	Ophthalmology	Ophthalmic Plastic and Reconstructive Surgery	A physician who specializes in oculofacial plastic and reconstructive surgery. This subspecialty combines orbital and periocular surgery with facial plastic surgery, and includes aesthetic and reconstructive surgery of the face, orbit, eyelid, and lacrimal system. Practitioners evaluate, diagnose and treat conditions involving the eyelids, brows, midface, orbits, lacrimal systems and surrounding and supporting structures of the face and neck.	Source:  American Academy of Ophthalmology, 2015 [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:207WX0200X	\N	\N	\N	\N	\N	f
207X00000X	207X00000X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	\N	An orthopaedic surgeon is trained in the preservation, investigation and restoration of the form and function of the extremities, spine and associated structures by medical, surgical and physical means.  An orthopaedic surgeon is involved with the care of patients whose musculoskeletal problems include congenital deformities, trauma, infections, tumors, metabolic disturbances of the musculoskeletal system, deformities, injuries and degenerative diseases of the spine, hands, feet, knee, hip, shoulder and elbow in children and adults. An orthopaedic surgeon is also concerned with primary and secondary muscular problems and the effects of central or peripheral nervous system lesions of the musculoskeletal system.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.  American Osteopathic Board of Orthopaedic Surgery, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Orthopaedic Surgery.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Orthopaedic Surgery.	\N	\N	\N	metaTaxonomyCode:207X00000X	\N	\N	\N	\N	\N	f
207XP3100X	207XP3100X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Pediatric Orthopaedic Surgery	An orthopedic surgeon who has additional training and experience in diagnosing, treating and managing musculoskeletal problems in infants, children and adolescents.  These may include limb and spine deformities (such as club foot, scoliosis); gait abnormalities (limping); bone and joint infections; broken bones.	Source: American Academy of Pediatrics [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:207XP3100X	\N	\N	\N	\N	\N	f
207XS0106X	207XS0106X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Hand Surgery	An orthopaedic surgeon trained in the investigation, preservation and restoration by medical, surgical and rehabilitative means of all structures of the upper extremity directly affecting the form and function of the hand and wrist.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.  American Osteopathic Board of Orthopaedic Surgery, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Orthopaedic Surgery.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Orthopaedic Surgery.	\N	\N	\N	metaTaxonomyCode:207XS0106X	\N	\N	\N	\N	\N	f
207XS0114X	207XS0114X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Adult Reconstructive Orthopaedic Surgery	Recognized by several state medical boards as a fellowship subspecialty program of orthopaedic surgery, adult reconstructive orthopaedic surgeons deal with reconstructive procedures such as joint arthroplasty (i.e., hip and knee), osteotomy, arthroscopy, soft-tissue reconstruction, and a variety of other adult reconstructive surgical procedures. 	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.      Separate board certification is not currently offered.	\N	\N	\N	metaTaxonomyCode:207XS0114X	\N	\N	\N	\N	\N	f
2084N0402X	2084N0402X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurology with Special Qualifications in Child Neurology	A Child Neurologist specializes in neurology with special skills in diagnosis and treatment of neurologic disorders of the neonatal period, infancy, early childhood, and adolescence.	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084N0402X	\N	\N	\N	\N	\N	f
