207XS0117X	207XS0117X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Orthopaedic Surgery of the Spine	Recognized by several state medical boards as a fellowship subspecialty program of orthopaedic surgery, orthopaedic surgeons of the spine deal with the evaluation and nonoperative and operative treatment of the full spectrum of primary spinal disorders including trauma, degenerative, deformity, tumor, and reconstructive.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.     Separate board certification is not currently offered.	\N	\N	\N	metaTaxonomyCode:207XS0117X	\N	\N	\N	\N	\N	f
207XX0004X	207XX0004X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Foot and Ankle Surgery	Recognized by several state medical boards as a fellowship subspecialty program of orthopaedic surgery, foot and ankle surgeons deal with adult reconstructive foot and ankle surgery, adult foot and ankle trauma, sports medicine foot and ankle, and children's foot and ankle reconstructive surgery.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: title modified, definiton added, source added]    Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.    Separate board certification is not currently offered.    ACGME Accredited Residency Program Requirements:  1 year of training with 5 years Orthopedic Surgery for a total of 6 years.	\N	\N	\N	metaTaxonomyCode:207XX0004X	\N	\N	\N	\N	\N	f
207XX0005X	207XX0005X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Sports Medicine	An orthopaedic surgeon trained in sports medicine provides appropriate care for all structures of the musculoskeletal system directly affected by participation in sporting activity. This specialist is proficient in areas including conditioning, training and fitness, athletic performance and the impact of dietary supplements, pharmaceuticals, and nutrition on performance and health, coordination of care within the team setting utilizing other health care professionals, field evaluation and management, soft tissue biomechanics and injury healing and repair. Knowledge and understanding of the principles and techniques of rehabilitation, athletic equipment and orthotic devices enables the specialist to prevent and manage athletic injuries.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton changed, source changed]    Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Orthopaedic Surgery.    ACGME Accredited Program Requirements: 1 year GME in the specialty + 5 years of Orthopaedic Surgery for a total of 6 years	\N	\N	\N	metaTaxonomyCode:207XX0005X	\N	\N	\N	\N	\N	f
207XX0801X	207XX0801X	Allopathic & Osteopathic Physicians	Orthopaedic Surgery	Orthopaedic Trauma	Recognized by several state medical boards as a fellowship subspecialty program of orthopaedic surgery, orthopaedic trauma surgeons deal with the evaluation and management of acute orthopaedic injuries, evaluation and treatment of post-traumatic deformities and nonunions, acute and delayed reconstruction of pelvic and acetabular fractures, as well as osteotomy in the adult hip for treatment of hip arthritis.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Orthopaedic Surgery, 2007.  http://www.abos.org/.     Separate board certification is not currently offered.	\N	\N	\N	metaTaxonomyCode:207XX0801X	\N	\N	\N	\N	\N	f
207Y00000X	207Y00000X	Allopathic & Osteopathic Physicians	Otolaryngology	\N	An otolaryngologist-head and neck surgeon provides comprehensive medical and surgical care for patients with diseases and disorders that affect the ears, nose, throat, the respiratory and upper alimentary systems and related structures of the head and neck. An otolaryngologist diagnoses and provides medical and/or surgical therapy or prevention of diseases, allergies, neoplasms, deformities, disorders and/or injuries of the ears, nose, sinuses, throat, respiratory and upper alimentary systems, face, jaws and the other head and neck systems. Head and neck oncology, facial plastic and reconstructive surgery and the treatment of disorders of hearing and voice are fundamental areas of expertise.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Otolaryngology, 2007.  http://www.aboto.org/.  American Osteopathic Board of Ophthalmology and Otolaryngology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Otolaryngology.   Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Ophthalmology and Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207Y00000X	\N	\N	\N	\N	\N	f
207YP0228X	207YP0228X	Allopathic & Osteopathic Physicians	Otolaryngology	Pediatric Otolaryngology	A pediatric otolaryngologist has special expertise in the management of infants and children with disorders that include congenital and acquired conditions involving the aerodigestive tract, nose and paranasal sinuses, the ear and other areas of the head and neck. The pediatric otolaryngologist has special skills in the diagnosis, treatment, and management of childhood disorders of voice, speech, language and hearing.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Otolaryngology, 2007.  http://www.aboto.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207YP0228X	\N	\N	\N	\N	\N	f
207YS0012X	207YS0012X	Allopathic & Osteopathic Physicians	Otolaryngology	Sleep Medicine	An Otolaryngologist who practices Sleep Medicine is certified in the subspecialty of sleep medicine and specializes in the clinical assessment, physiologic testing, diagnosis, management and prevention of sleep and circadian rhythm disorders. Sleep specialists treat patients of any age and use multidisciplinary approaches. Disorders managed by sleep specialists include, but are not limited to, sleep related breathing disorders, insomnia, hypersomnias, circadian rhythm sleep disorders, parasomnias and sleep related movement disorders.	Source: American Academy of Sleep Medicine [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:207YS0012X	\N	\N	\N	\N	\N	f
207YS0123X	207YS0123X	Allopathic & Osteopathic Physicians	Otolaryngology	Facial Plastic Surgery	An otolaryngologist who specializes in facial plastic surgery.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A General Certificate was, but is no longer issued by the American Osteopathic Board of Ophthalmology and Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207YS0123X	\N	\N	\N	\N	\N	f
2084N0600X	2084N0600X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Clinical Neurophysiology	Clinical Neurophysiology is a subspecialty with psychiatric or neurologic expertise in the diagnosis and management of central, peripheral, and autonomic nervous system disorders using combined clinical evaluation and electrophysiologic testing such as electroencephalography (EEG), electromyography (EMG), and nerve conduction studies (NCS).	Source:  The American Board of Psychiatry and Neurology, Inc. [1/1/2007: new definition]	\N	\N	\N	metaTaxonomyCode:2084N0600X	\N	\N	\N	\N	\N	f
207YX0007X	207YX0007X	Allopathic & Osteopathic Physicians	Otolaryngology	Plastic Surgery within the Head & Neck	An otolaryngologist with additional training in plastic and reconstructive procedures within the head, face, neck and associated structures, including cutaneous head and neck oncology and reconstruction, management of maxillofacial trauma, soft tissue repair and neural surgery. The field is diverse and involves a wide age range of patients, from the newborn to the aged. While both cosmetic and reconstructive surgeries are practiced, there are many additional procedures which interface with them.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Otolaryngology, 2007.  http://www.aboto.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Otolaryngology.   Board certification for Doctors of Osteopathy is currently provided in the subspecialty of Otolaryngology/Facial Plastic Surgery (see Taxonomy Code 207YX0905X)	\N	\N	\N	metaTaxonomyCode:207YX0007X	\N	\N	\N	\N	\N	f
207YX0602X	207YX0602X	Allopathic & Osteopathic Physicians	Otolaryngology	Otolaryngic Allergy	An otolaryngologist who specializes in the diagnosis and treatment of otolaryngic allergies and other allergic diseases.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A Certification of Added Qualifications (CAQ) is issued by the American Osteopathic Board of Ophthalmology and Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207YX0602X	\N	\N	\N	\N	\N	f
207YX0901X	207YX0901X	Allopathic & Osteopathic Physicians	Otolaryngology	Otology & Neurotology	An otolaryngologist who treats diseases of the ear and temporal bone, including disorders of hearing and balance. The additional training in otology and neurotology emphasizes the study of embryology, anatomy, physiology, epidemiology, pathophysiology, pathology, genetics, immunology, microbiology and the etiology of diseases of the ear and temporal bone.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Otolaryngology, 2007.  http://www.aboto.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207YX0901X	\N	\N	\N	\N	\N	f
207YX0905X	207YX0905X	Allopathic & Osteopathic Physicians	Otolaryngology	Otolaryngology/Facial Plastic Surgery	An otolaryngologist who specializes in the diagnosis and surgical treatment of head and neck conditions.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A General Certificate is issued by the American Osteopathic Board of Ophthalmology and Otolaryngology.	\N	\N	\N	metaTaxonomyCode:207YX0905X	\N	\N	\N	\N	\N	f
207ZB0001X	207ZB0001X	Allopathic & Osteopathic Physicians	Pathology	Blood Banking & Transfusion Medicine	A physician who specializes in blood banking/transfusion medicine is responsible for the maintenance of an adequate blood supply, blood donor and patient-recipient safety and appropriate blood utilization. Pre-transfusion compatibility testing and antibody testing assure that blood transfusions, when indicated, are as safe as possible. This physician directs the preparation and safe use of specially prepared blood components, including red blood cells, white blood cells, platelets and plasma constituents, and marrow or stem cells for transplantation.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZB0001X	\N	\N	\N	\N	\N	f
207ZC0006X	207ZC0006X	Allopathic & Osteopathic Physicians	Pathology	Clinical Pathology	A pathologist deals with the causes and nature of disease and contributes to diagnosis, prognosis and treatment through knowledge gained by the laboratory application of the biologic, chemical and physical sciences. A pathologist uses information gathered from the microscopic examination of tissue specimens, cells and body fluids, and from clinical laboratory tests on body fluids and secretions for the diagnosis, exclusion and monitoring of disease.	Source: American Board of Medical Specialties, 2007. www.abms.org [7/1/2007: new, 7/1/2009: definition reformatted]   Additional Resources: American Board of Pathology, 2007. http://www.abpath.org/   This taxonomy code identifies the combined anatomic "clinical pathology only" route. Board Certification for Medical Doctors (MDs) is provided by the American Board of Pathology. To acknowledge the diverse activities in the practice of pathology and to accommodate the interests of individuals wanting to enter the field, the ABP offers primary certification through the following three routes: combined anatomic pathology and clinical pathology, anatomic pathology only and clinical pathology only. Primary certification in anatomic pathology or clinical pathology may be combined with some of the subspecialty certifications.	\N	\N	\N	metaTaxonomyCode:207ZC0006X	\N	\N	\N	\N	\N	f
207ZC0008X	207ZC0008X	Allopathic & Osteopathic Physicians	Pathology	Clinical Informatics	Physicians who practice Clinical Informatics collaborate with other health care and information technology professionals to analyze, design, implement and evaluate information and communication systems that enhance individual and population health outcomes, improve patient care, and strengthen the clinician-patient relationship. Clinical Informaticians use their knowledge of patient care combined with their understanding of informatics concepts, methods, and tools to: assess information and knowledge needs of health care professionals and patients; characterize, evaluate, and refine clinical processes; develop, implement, and refine clinical decision support systems; and lead or participate in the procurement, customization, development, implementation, management, evaluation, and continuous improvement of clinical information systems.	Source: The American Board of Preventive Medicine, 2013 [1/1/2014: new]  Additional Resources: The American Board of Pathology, www.abpath.org	\N	\N	\N	metaTaxonomyCode:207ZC0008X	\N	\N	\N	\N	\N	f
207ZC0500X	207ZC0500X	Allopathic & Osteopathic Physicians	Pathology	Cytopathology	A cytopathologist is an anatomic pathologist trained in the diagnosis of human disease by means of the study of cells obtained from body secretions and fluids, by scraping, washing, or sponging the surface of a lesion, or by the aspiration of a tumor mass or body organ with a fine needle.  A major aspect of a cytopathologist’s practice is the interpretation of Papanicolaou-stained smears of cells from the female reproductive systems, the “Pap” test.  However, the cytopathologist’s expertise is applied to the diagnosis of cells from all systems and areas of the body.  He/she is a consultant to all medical specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton changed, source added]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZC0500X	\N	\N	\N	\N	\N	f
207ZD0900X	207ZD0900X	Allopathic & Osteopathic Physicians	Pathology	Dermatopathology	A dermatopathologist is an expert in diagnosing and monitoring diseases of the skin including infectious, immunologic, degenerative, and neoplastic diseases.  This entails the examination and interpretation of specially prepared tissue sections, cellular scrapings, and smears of skin lesions by means of light microscopy, electron microscopy, and fluorescence microscopy.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton changed, source added]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.    A subspecialty certificate was first issued by the ABMS in 1974.    ACGME Accredited Residency Program Requirements:  None.	\N	\N	\N	metaTaxonomyCode:207ZD0900X	\N	\N	\N	\N	\N	f
207ZF0201X	207ZF0201X	Allopathic & Osteopathic Physicians	Pathology	Forensic Pathology	A forensic pathologist is expert in investigating and evaluating cases of sudden, unexpected, suspicious and violent death as well as other specific classes of death defined by law. The forensic pathologist serves the public as coroner or medical examiner, or by performing medicolegal autopsies for such officials.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZF0201X	\N	\N	\N	\N	\N	f
207ZH0000X	207ZH0000X	Allopathic & Osteopathic Physicians	Pathology	Hematology	A hematopathologist is expert in diseases that affect blood cells, blood clotting mechanisms, bone marrow and lymph nodes. This physician has the knowledge and technical skills essential for the laboratory diagnosis of anemias, leukemias, lymphomas, bleeding disorders and blood clotting disorders.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZH0000X	\N	\N	\N	\N	\N	f
207ZI0100X	207ZI0100X	Allopathic & Osteopathic Physicians	Pathology	Immunopathology	A pathologist who specializes in the diagnosis of immunologic diseases.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]    Additional Resources: A Certification of Added Qualifications (CAQ) was, but is no longer issued by the American Osteopathic Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZI0100X	\N	\N	\N	\N	\N	f
207ZM0300X	207ZM0300X	Allopathic & Osteopathic Physicians	Pathology	Medical Microbiology	A medical microbiologist is expert in the isolation and identification of microbial agents that cause infectious disease. Viruses, bacteria and fungi, as well as parasites, are identified and, where possible, tested for susceptibility to appropriate antimicrobial agents.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZM0300X	\N	\N	\N	\N	\N	f
207ZN0500X	207ZN0500X	Allopathic & Osteopathic Physicians	Pathology	Neuropathology	A neuropathologist is expert in the diagnosis of diseases of the nervous system and skeletal muscles and functions as a consultant primarily to neurologists and neurosurgeons. The neuropathologist is knowledgeable in the infirmities of humans as they affect the nervous and neuromuscular systems, be they degenerative, infectious, metabolic, immunologic, neoplastic, vascular or physical in nature.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZN0500X	\N	\N	\N	\N	\N	f
207ZP0007X	207ZP0007X	Allopathic & Osteopathic Physicians	Pathology	Molecular Genetic Pathology	A molecular genetic pathologist is expert in the principles, theory and technologies of molecular biology and molecular genetics. This expertise is used to make or confirm diagnoses of Mendelian genetic disorders, disorders of human development, infectious diseases and malignancies, and to assess the natural history of those disorders. A molecular genetic pathologist provides information about gene structure, function and alteration and applies laboratory techniques for diagnosis, treatment and prognosis for individuals with related disorders.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton changed, source changed]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.       A subspecialty certificate for MGG was approved by the ABMS in 1999.     ACGME Accredited Residency Program Requirements:  Proposal under development.	\N	\N	\N	metaTaxonomyCode:207ZP0007X	\N	\N	\N	\N	\N	f
2080A0000X	2080A0000X	Allopathic & Osteopathic Physicians	Pediatrics	Adolescent Medicine	A pediatrician who specializes in adolescent medicine is a multi-disciplinary healthcare specialist trained in the unique physical, psychological and social characteristics of adolescents, their healthcare problems and needs.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080A0000X	\N	\N	\N	\N	\N	f
