207ZP0101X	207ZP0101X	Allopathic & Osteopathic Physicians	Pathology	Anatomic Pathology	A pathologist deals with the causes and nature of disease and contributes to diagnosis, prognosis and treatment through knowledge gained by the laboratory application of the biologic, chemical and physical sciences. A pathologist uses information gathered from the microscopic examination of tissue specimens, cells and body fluids, and from clinical laboratory tests on body fluids and secretions for the diagnosis, exclusion and monitoring of disease.	Source: American Board of Medical Specialties, 2007. [7/1/2007: definition added, source added, 7/1/2009: defintion reformatted; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007. http://www.abpath.org/. American Osteopathic Board of Pathology, 2007. http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology (note: this taxonomy code identifies the "anatomic pathology only" route). To acknowledge the diverse activities in the practice of pathology and to accommodate the interests of individuals wanting to enter the field, the ABP offers primary certification through the following three routes: combined anatomic pathology and clinical pathology, anatomic pathology only and clinical pathology only. Primary certification in anatomic pathology or clinical pathology may be combined with some of the subspecialty certifications.	\N	\N	\N	metaTaxonomyCode:207ZP0101X	\N	\N	\N	\N	\N	f
207ZP0102X	207ZP0102X	Allopathic & Osteopathic Physicians	Pathology	Anatomic Pathology & Clinical Pathology	A pathologist deals with the causes and nature of disease and contributes to diagnosis, prognosis and treatment through knowledge gained by the laboratory application of the biologic, chemical and physical sciences. A pathologist uses information gathered from the microscopic examination of tissue specimens, cells and body fluids, and from clinical laboratory tests on body fluids and secretions for the diagnosis, exclusion and monitoring of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added, 7/1/2009: definition reformatted]    Additional Resources: American Board of Pathology, 2007. http://www.abpath.org/    This taxonomy code identifies the combined anatomic pathology & clinical pathology route. Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology. To acknowledge the diverse activities in the practice of pathology and to accommodate the interests of individuals wanting to enter the field, the ABP offers primary certification through the following three routes: combined anatomic pathology and clinical pathology, anatomic pathology only and clinical pathology only. Primary certification in anatomic pathology or clinical pathology may be combined with some of the subspecialty certifications.	\N	\N	\N	metaTaxonomyCode:207ZP0102X	\N	\N	\N	\N	\N	f
207ZP0104X	207ZP0104X	Allopathic & Osteopathic Physicians	Pathology	Chemical Pathology	A chemical pathologist has expertise in the biochemistry of the human body as it applies to the understanding of the cause and progress of disease. This physician functions as a clinical consultant in the diagnosis and treatment of human disease. Chemical pathology entails the application of biochemical data to the detection, confirmation or monitoring of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) was provided by the American Osteopathic Board of Pathology.  The Certification is NO longer provided.	\N	\N	\N	metaTaxonomyCode:207ZP0104X	\N	\N	\N	\N	\N	f
207ZP0105X	207ZP0105X	Allopathic & Osteopathic Physicians	Pathology	Clinical Pathology/Laboratory Medicine	A pathologist deals with the causes and nature of disease and contributes to diagnosis, prognosis and treatment through knowledge gained by the laboratory application of the biologic, chemical and physical sciences. A pathologist uses information gathered from the microscopic examination of tissue specimens, cells and body fluids, and from clinical laboratory tests on body fluids and secretions for the diagnosis, exclusion and monitoring of disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.  American Osteopathic Board of Pathology, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZP0105X	\N	\N	\N	\N	\N	f
207ZP0213X	207ZP0213X	Allopathic & Osteopathic Physicians	Pathology	Pediatric Pathology	A pediatric pathologist is expert in the laboratory diagnosis of diseases that occur during fetal growth, infancy and child development. The practice requires a strong foundation in general pathology and substantial understanding of normal growth and development, along with extensive knowledge of pediatric medicine.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definiton added, source added]    Additional Resources: American Board of Pathology, 2007.  http://www.abpath.org/.     Board certification for Medical Doctors (MDs) is provided by the American Board of Pathology.	\N	\N	\N	metaTaxonomyCode:207ZP0213X	\N	\N	\N	\N	\N	f
208000000X	208000000X	Allopathic & Osteopathic Physicians	Pediatrics	\N	A pediatrician is concerned with the physical, emotional and social health of children from birth to young adulthood. Care encompasses a broad spectrum of health services ranging from preventive healthcare to the diagnosis and treatment of acute and chronic diseases. A pediatrician deals with biological, social and environmental influences on the developing child, and with the impact of disease and dysfunction on development.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.  American Osteopathic Board of Pediatrics, 2007.  http://www.osteopathic.org/certificatio<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:208000000X	\N	\N	\N	\N	\N	f
2080P0216X	2080P0216X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Rheumatology	A pediatrician who treats diseases of joints, muscle, bones and tendons. A pediatric rheumatologist diagnoses and treats arthritis, back pain, muscle strains, common athletic injuries and "collagen" diseases.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.	\N	\N	\N	metaTaxonomyCode:2080P0216X	\N	\N	\N	\N	\N	f
