2080B0002X	2080B0002X	Allopathic & Osteopathic Physicians	Pediatrics	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: new]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:2080B0002X	\N	\N	\N	\N	\N	f
2080C0008X	2080C0008X	Allopathic & Osteopathic Physicians	Pediatrics	Child Abuse Pediatrics	A Child Abuse Pediatrician serves as a resource to children, families and communities by accurately diagnosing abuse; consulting with community agencies on child safety; providing expertise in courts of law; treating consequences of abuse and neglect; directing child abuse and neglect prevention programs and participating on multidisciplinary teams investigating; and managing child abuse cases. 	Source: American Board of Medical Specialties, 2009 [7/1/2009: definition added]	\N	\N	\N	metaTaxonomyCode:2080C0008X	\N	\N	\N	\N	\N	f
2080H0002X	2080H0002X	Allopathic & Osteopathic Physicians	Pediatrics	Hospice and Palliative Medicine	A pediatrician with special knowledge and skills to prevent and relieve the suffering experienced by patients with life-limiting illnesses. This specialist works with an interdisciplinary hospice or palliative care team to maximize quality of life while addressing physical, psychological, social and spiritual needs of both patient and family throughout the course of the disease, through the dying process, and beyond for the family.  This specialist has expertise in the assessment of patients with advanced disease; the relief of distressing symptoms; the coordination of interdisciplinary patient and family-centered care in diverse venues; the use of specialized care systems including hospice; the management of the imminently dying patient; and legal and ethical decision making in end-of-life care.	Source: American Academy of Hospice and Palliative Medicine [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:2080H0002X	\N	\N	\N	\N	\N	f
