2080P0203X	2080P0203X	Allopathic & Osteopathic Physicians	Pediatrics	Pediatric Critical Care Medicine	A pediatrician expert in advanced life support for children from the term or near-term neonate to the adolescent. This competence extends to the critical care management of life-threatening organ system failure from any cause in both medical and surgical patients and to the support of vital physiological functions. This specialist may have administrative responsibilities for intensive care units and also facilitates patient care among other specialists.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition changed, source added]    Additional Resources: American Board of Pediatrics, 2007.  http://www.abp.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Pediatrics.    ACGME Accredited Residency Program Requirements: 2 years of training with 3 years Pediatrics plus 1 year Pediatric Critical Care for certification for a total of 6 years.    ABMS Approved Subspecialty Certificate (Pediatrics)	\N	\N	\N	metaTaxonomyCode:2080P0203X	\N	\N	\N	\N	\N	f
