2083A0100X	2083A0100X	Allopathic & Osteopathic Physicians	Preventive Medicine	Aerospace Medicine	Aerospace medicine focuses on the clinical care, research, and operational support of the health, safety, and performance of crewmembers and passengers of air and space vehicles, together with the support personnel who assist operation of such vehicles. This population often works and lives in remote, isolated, extreme, or enclosed environments under conditions of physical and psychological stress. Practitioners strive for an optimal human-machine match in occupational settings rich with environmental hazards and engineering countermeasures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.  American Osteopathic Board of Preventive Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083A0100X	\N	\N	\N	\N	\N	f
2083B0002X	2083B0002X	Allopathic & Osteopathic Physicians	Preventive Medicine	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: new]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:2083B0002X	\N	\N	\N	\N	\N	f
2083C0008X	2083C0008X	Allopathic & Osteopathic Physicians	Preventive Medicine	Clinical Informatics	Physicians who practice Clinical Informatics collaborate with other health care and information technology professionals to analyze, design, implement and evaluate information and communication systems that enhance individual and population health outcomes, improve patient care, and strengthen the clinician-patient relationship. Clinical Informaticians use their knowledge of patient care combined with their understanding of informatics concepts, methods, and tools to: assess information and knowledge needs of health care professionals and patients; characterize, evaluate, and refine clinical processes; develop, implement, and refine clinical decision support systems; and lead or participate in the procurement, customization, development, implementation, management, evaluation, and continuous improvement of clinical information systems.	Source: The American Board of Preventive Medicine, 2013 [1/1/2014: new]  Additional Resources: The American Board of Preventive Medicine, www.theabpm.org	\N	\N	\N	metaTaxonomyCode:2083C0008X	\N	\N	\N	\N	\N	f
2083P0011X	2083P0011X	Allopathic & Osteopathic Physicians	Preventive Medicine	Undersea and Hyperbaric Medicine	A specialist who treats decompression illness and diving accident cases and uses hyperbaric oxygen therapy to treat such conditions as carbon monoxide poisoning, gas gangrene, non-healing wounds, tissue damage from radiation and burns and bone infections. This specialist also serves as consultant to other physicians in all aspects of hyperbaric chamber operations and assesses risks and applies appropriate standards to prevent disease and disability in divers and other persons working in altered atmospheric conditions.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083P0011X	\N	\N	\N	\N	\N	f
2083P0500X	2083P0500X	Allopathic & Osteopathic Physicians	Preventive Medicine	Preventive Medicine/Occupational Environmental Medicine	A preventive medicine physician who specializes in preventive medicine/occupational-environmental medicine, which is focused on protecting the population from occupational and environmental conditions.	Source: National Uniform Claim Committee, 2009 [1/1/2010: definition added, source added]   Additional Resources: A General Certificate is issued by the American Osteopathic Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083P0500X	\N	\N	\N	\N	\N	f
2083P0901X	2083P0901X	Allopathic & Osteopathic Physicians	Preventive Medicine	Public Health & General Preventive Medicine	Public health and general preventive medicine focuses on promoting health, preventing disease, and managing the health of communities and defined populations. These practitioners combine population-based public health skills with knowledge of primary, secondary, and tertiary prevention-oriented clinical practice in a wide variety of settings.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.  American Osteopathic Board of Preventive Medicine, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083P0901X	\N	\N	\N	\N	\N	f
