2083T0002X	2083T0002X	Allopathic & Osteopathic Physicians	Preventive Medicine	Medical Toxicology	Medical toxicologists are physicians who specialize in the prevention, evaluation, treatment and monitoring of injury and illness from exposures to drugs and chemicals, as well as biological and radiological agents. Medical toxicologists care for people in clinical, academic, governmental and public health settings, and provide poison control center leadership. Important areas of medical toxicology include acute drug poisoning, adverse drug events, drug abuse, addiction and withdrawal, chemicals and hazardous materials, terrorism preparedness, venomous bites and stings, and environmental and workplace exposures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083T0002X	\N	\N	\N	\N	\N	f
2083X0100X	2083X0100X	Allopathic & Osteopathic Physicians	Preventive Medicine	Occupational Medicine	Occupational medicine focuses on the health of workers, including the ability to perform work; the physical, chemical, biological, and social environments of the workplace; and the health outcomes of environmental exposures. Practitioners in this field address the promotion of health in the work place, and the prevention and management of occupational and environmental injury, illness, and disability.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Preventive Medicine, 2007.  http://www.abprevmed.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Preventive Medicine.	\N	\N	\N	metaTaxonomyCode:2083X0100X	\N	\N	\N	\N	\N	f
2084A0401X	2084A0401X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Addiction Medicine	A doctor of osteopathy board eligible/certified in the field of Psychiatry by the American Osteopathic Board of Neurology and Psychiatry is able to obtain a Certificate of Added Qualifications in the field of Addiction Medicine	Source: American Osteopathic Board of Neurology and Psychiatry, 2007 [1/1/2008: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: http://www.osteopathic.org/certification	\N	\N	\N	metaTaxonomyCode:2084A0401X	\N	\N	\N	\N	\N	f
2084A2900X	2084A2900X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Neurocritical Care	The medical subspecialty of Neurocritical Care is devoted to the comprehensive, multisystem care of the critically-ill neurological patient. Like other intensivists, the neurointensivist generally assumes the primary role for coordinating the care of his or her patients in the ICU, both the neurological and medical management of the patient.  They may also provide consultative services for these patients as requested within the health system.	Source: Adapted from the United Council for Neurologic Subspecialties website definition at: http://www.ucns.org/go/subspecialty/neurocritical [7/1/2016: new]	\N	\N	\N	metaTaxonomyCode:2084A2900X	\N	\N	\N	\N	\N	f
2084B0002X	2084B0002X	Allopathic & Osteopathic Physicians	Psychiatry & Neurology	Obesity Medicine	A physician who specializes in the treatment of obesity demonstrates competency in and a thorough understanding of the treatment of obesity and the genetic, biologic, environmental, social, and behavioral factors that contribute to obesity. The obesity medicine physician employs therapeutic interventions including diet, physical activity, behavioral change, and pharmacotherapy. The obesity medicine physician utilizes a comprehensive approach, and may include additional resources such as dietitians, exercise physiologists, mental health professionals and bariatric surgeons as indicated to achieve optimal results. Additionally, the obesity medicine physician maintains competency in providing pre- peri- and post-surgical care of bariatric surgery patients, promotes the prevention of obesity, and advocates for those who suffer from obesity.	Source:  American Board of Obesity Medicine [7/1/2015: title and definition modified]  Additional Resource: American Society of Bariatric Physicians, www.asbp.org.	\N	\N	\N	metaTaxonomyCode:2084B0002X	\N	\N	\N	\N	\N	f
