2086S0129X	2086S0129X	Allopathic & Osteopathic Physicians	Surgery	Vascular Surgery	A surgeon with expertise in the management of surgical disorders of the blood vessels, excluding the intracranial vessels or the heart.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added; 7/1/2011: modified source]<br/><br/>Additional Resources: American Board of Surgery, 2007.  http://www.absurgery.org/.   American Osteopathic Board of Surgery, 2007.  http://www.osteopathic.org/certification<br/><br/>Board certification for Medical Doctors (MDs) is provided by the American Board of Surgery.  Board certification for Doctors of Osteopathy (DOs) is provided by the American Osteopathic Board of Surgery.	\N	\N	\N	metaTaxonomyCode:2086S0129X	\N	\N	\N	\N	\N	f
2086X0206X	2086X0206X	Allopathic & Osteopathic Physicians	Surgery	Surgical Oncology	A surgical oncologist is a well-qualified surgeon who has obtained additional training and experience in the multidisciplinary approach to the prevention, diagnosis, treatment, and rehabilitation of cancer patients, and devotes a major portion of his or her professional practice to these activities and cancer research.	Source: Society of Surgical Oncology, 2007 [1/1/2008: definition added, source added, 7/1/2009: definiition reformatted]    Additional Resources: http://www.surgonc.org/ ; American Board of Medical Specialties, 2007, www.abms.org ; American Board of Surgery, 2007, http://www.absurgery.org/     Surgical oncology is a recognized fellowship subspecialty program of surgery. Separate board certification is not currently offered.	\N	\N	\N	metaTaxonomyCode:2086X0206X	\N	\N	\N	\N	\N	f
208800000X	208800000X	Allopathic & Osteopathic Physicians	Urology	\N	A urologist manages benign and malignant medical and surgical disorders of the genitourinary system and the adrenal gland. This specialist has comprehensive knowledge of and skills in endoscopic, percutaneous and open surgery of congenital and acquired conditions of the urinary and reproductive systems and their contiguous structures.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Urology, 2007.  http://www.abu.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Urology.	\N	\N	\N	metaTaxonomyCode:208800000X	\N	\N	\N	\N	\N	f
2088F0040X	2088F0040X	Allopathic & Osteopathic Physicians	Urology	Female Pelvic Medicine and Reconstructive Surgery	A subspecialist in Female Pelvic Medicine and Reconstructive Surgery is a physician in Urology or Obstetrics and Gynecology who, by virtue of education and training, is prepared to provide consultation and comprehensive management of women with complex benign pelvic conditions, lower urinary tract disorders, and pelvic floor dysfunction. Comprehensive management includes those diagnostic and therapeutic procedures necessary for the total care of the patient with these conditions and complications resulting from them.	Source: American Board of Medical Specialties, 2011. [1/1/2012: new]  Resources:  www.abms.org	\N	\N	\N	metaTaxonomyCode:2088F0040X	\N	\N	\N	\N	\N	f
2088P0231X	2088P0231X	Allopathic & Osteopathic Physicians	Urology	Pediatric Urology	Surgeons who can diagnose, treat, and manage children’s urinary and genital problems. A pediatric urologist devotes a minimum of 50% of his or her practice to the urologic problems of infants, children, and adolescents.  Pediatric urologists generally provide the following services:  the evaluation and management of voiding disorders; vesicoureteral reflux, and urinary tract infections that require surgery; surgical reconstruction of the urinary tract (kidneys, ureters, and bladder) including genital abnormalities, hypospadias, and intersex conditions; surgery for groin conditions in childhood and adolescence (undescended testes, hydrocele/hernia, varicocele).	Source: American Academy of Pediatrics [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:2088P0231X	\N	\N	\N	\N	\N	f
208C00000X	208C00000X	Allopathic & Osteopathic Physicians	Colon & Rectal Surgery	\N	A colon and rectal surgeon is trained to diagnose and treat various diseases of the intestinal tract, colon, rectum, anal canal and perianal area by medical and surgical means. This specialist also deals with other organs and tissues (such as the liver, urinary and female reproductive system) involved with primary intestinal disease.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007:  added definition, added source]    Additional Resources: American Board of Colon and Rectal Surgery, 2007.  http://www.abcrs.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Colon and Rectal Surgery.    Colon and rectal surgeons have the expertise to diagnose and often manage anorectal conditions such as hemorrhoids, fissures (painful tears in the anal lining), abscesses and fistulae (infections located around the anus and rectum) in the office setting. They also treat problems of the intestine and colon, and perform endoscopic procedures to evaluate and treat problems such as cancer, polyps (precancerous growths) and inflammatory conditions. 	\N	\N	\N	metaTaxonomyCode:208C00000X	\N	\N	\N	\N	\N	f
