208G00000X	208G00000X	Allopathic & Osteopathic Physicians	Thoracic Surgery (Cardiothoracic Vascular Surgery)	\N	A thoracic surgeon provides the operative, perioperative and critical care of patients with pathologic conditions within the chest. Included is the surgical care of coronary artery disease, cancers of the lung, esophagus and chest wall, abnormalities of the trachea, abnormalities of the great vessels and heart valves, congenital anomalies, tumors of the mediastinum and diseases of the diaphragm. The management of the airway and injuries of the chest is within the scope of the specialty.	Source: American Board of Medical Specialties, 2007.  www.abms.org [7/1/2007: definition added, source added]    Additional Resources: American Board of Thoracic Surgery, 2007.  http://www.abts.org/.    Board certification for Medical Doctors (MDs) is provided by the American Board of Thoracic Surgery.    Thoracic surgeons have the knowledge, experience and technical skills to accurately diagnose, operate upon safely, and effectively manage patients with thoracic diseases of the chest. This requires substantial knowledge of cardiorespiratory physiology and oncology, as well as capability in the use of heart assist devices, management of abnormal heart rhythms and drainage of the chest cavity, respiratory support systems, endoscopy and invasive and noninvasive diagnostic techniques.  	\N	\N	\N	metaTaxonomyCode:208G00000X	\N	\N	\N	\N	\N	f
208M00000X	208M00000X	Allopathic & Osteopathic Physicians	Hospitalist	\N	Hospitalists are physicians whose primary professional focus is the general medical care of hospitalized patients. Their activities include patient care, teaching, research, and leadership related to Hospital Medicine. The term 'hospitalist' refers to physicians whose practice emphasizes providing care for hospitalized patients.	Source: American Society of Hospital Medicine, 2007.  http://www.hospitalmedicine.org/ [7/1/2009: definition aded]  Additional Resources: Hospitalist is a recognized fellowship specialty program offered by many medical institutions.  There is no board certification for the specialty at this point.	\N	\N	\N	metaTaxonomyCode:208M00000X	\N	\N	\N	\N	\N	f
