224ZE0001X	224ZE0001X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapy Assistant	Environmental Modification	Occupational therapy assistants provide environmental modifications under the supervision of an occupational therapist.  OTAs develop and implement an individualized occupational therapy environmental modification plan that reflects the relevant contexts of the client and relevant others and maximizes current and future occupational performance, safety, and participation of the client. Clients receive environmental modification recommendations and interventions that enable them to meet occupational performance and participation goals and that have adequate flexibility to accommodate for their future needs.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for an Environmental Modification Occupational Therapy Assistant if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>Fact Sheet: Home Modifications and OT,  AOTA Website: Specialty Certifications	\N	\N	\N	metaTaxonomyCode:224ZE0001X	\N	\N	\N	\N	\N	f
224ZF0002X	224ZF0002X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapy Assistant	Feeding, Eating & Swallowing	Occupational therapy assistants provide environmental modifications under the supervision of an occupational therapist.  OTAs develop and implement an individualized occupational therapy environmental modification plan that reflects the relevant contexts of the client and relevant others and maximizes current and future occupational performance, safety, and participation of the client. Clients receive environmental modification recommendations and interventions that enable them to meet occupational performance and participation goals and that have adequate flexibility to accommodate for their future needs.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Feeding, Eating & Swallowing Occupational Therapy Assistant if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Website: Specialty Certifications; AOTA Specialized Knowledge and Skills Paper: Feeding, Eating and Swallowing in Occupational Therapy Practice, 2007; AOTA Fact Sheets: OT: A Vital Role in Dysphagia Care	\N	\N	\N	metaTaxonomyCode:224ZF0002X	\N	\N	\N	\N	\N	f
224ZL0004X	224ZL0004X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapy Assistant	Low Vision	Occupational therapy assistants contribute to the completion of an individualized occupational therapy low-vision evaluation under the direction and supervision of the occupational therapist to identify factors that may facilitate, compensate for, or inhibit use of vision in occupational performance.  Clients are engaged in the identification of strengths, limitations, and goals as they relate to low vision to optimize independence and participation in desired occupations.  Occupational therapy assistants also contribute to the development and implementation of an individualized occupational therapy low-vision intervention plan in collaboration with the occupational therapist, client, and relevant others that reflects the client’s priorities for occupational performance.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Low Vision Occupational Therapy Assistant if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Fact Sheets: Low Vision; OT Services for Individuals with Visual Impairments	\N	\N	\N	metaTaxonomyCode:224ZL0004X	\N	\N	\N	\N	\N	f
224ZR0403X	224ZR0403X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapy Assistant	Driving and Community Mobility	Occupational therapy assistants contribute to the completion of an individualized occupational therapy driving and community mobility evaluation by administering delegated assessments and identifying findings that impact the client's occupational performance. Clients engage in the assessment and occupational profile process to customize the evaluation to their individual driving and community mobility needs.  Occupational therapy assistants administer and continuously modify individualized in-vehicle and community mobility assessments within the naturalistic context of the community in response to the occupational performance and safety behaviors of the client.  They also implement an individualized intervention plan, within the parameters established in collaboration with the occupational therapist that reflects the contexts of the client and meets his or her occupational performance and safety needs.  Occupational therapy assistants address immediate and long-term implications of psychosocial issues related to compromised driving and community mobility throughout the occupational therapy process and makes recommendations to the occupational therapist for modification to service delivery.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Driving & Community Mobility Occupational Therapy Assistant if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Fact Sheets: Older Driver; AOTA Website: Specialty Certification	\N	\N	\N	metaTaxonomyCode:224ZR0403X	\N	\N	\N	\N	\N	f
