225XF0002X	225XF0002X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Feeding, Eating & Swallowing	Occupational therapists provide interventions to clients of all ages with feeding, eating and swallowing difficulties.  Occupational therapists provide comprehensive rehabilitative, habilitative, and palliative dysphagia care, which includes collaborating with clients to provide individualized compensatory swallowing strategies, modified diet textures, adapted mealtime environments, enhanced feeding skills, preparatory exercises and positioning to clients, reinforcement of mealtime strategies to enhance and improve swallowing skills, and training to caregivers to enhance eating and feeding performance.  Occupational therapists provide screening and in-depth clinical assessment which may include instrumental dysphagia assessments including videofluroscopy.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Feeding, Eating & Swallowing Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Specialized Knowledge and Skills Paper: Feeding, Eating and Swallowing in Occupational Therapy Practice, 2007; AOTA Fact Sheets: OT: A Vital Role in Dysphagia Care	\N	\N	\N	metaTaxonomyCode:225XF0002X	\N	\N	\N	\N	\N	f
225XG0600X	225XG0600X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Gerontology	Occupational therapists work with older adults in virtually every setting: assisted living, wellness programs, hospitals, nursing homes, senior centers, clinics and in the home. Occupational therapists bring an understanding of the importance of participation and occupation for overall well-being to those who are experiencing disabling conditions related to aging. The primary overarching goal of occupational therapy services with this population is to maximize independence and participation, thereby enabling an older person to continue to live successfully in his or her chosen environment. Occupational therapists can help older adults by developing strategies to help or maintain safety and well-being, to assist with life transitions, and to compensate for challenges they experience in activities of daily living, instrumental activities of daily living, leisure participation, social participation, and productive activities.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary board certification for a Gerontology Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 5 years of practice as an occupational therapist.  <li>Minimum of 5,000 hours of experience as an occupational therapist in the certification area in the last 7 calendar years.  <li>Minimum of 500 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 5 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Fact Sheets: Senior Center and Assisted Living Facilities	\N	\N	\N	metaTaxonomyCode:225XG0600X	\N	\N	\N	\N	\N	f
