225XP0019X	225XP0019X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Physical Rehabilitation	Occupational therapists are experts at helping people lead as independent a life as possible.  Occupational therapists bring an understanding of the physical and psychological implications of illness and injury and their effects on peoples' ability to perform the tasks of daily living.  Occupational therapists provide interventions that can aide a person in completing ADL and IADL tasks, such as dressing, bathing, preparing meals, and driving.  They also may fabricate custom orthotics to improve function, evaluate the environment for safety hazards and recommend adaptations to remove those hazards, help a person compensate for cognitive changes, and build a persons’ physical endurance and strength. Occupational therapists' knowledge of adapting tasks and modifying the environment to compensate for functional limitations is used to increase the involvement of clients and to promote safety and success.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary board certification for a Physical Rehabilitation Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 5 years of practice as an occupational therapist.  <li>Minimum of 5,000 hours of experience as an occupational therapist in the certification area in the last 7 calendar years.  <li>Minimum of 500 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 5 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul>AOTA Consumer Tip Sheets: Stroke, Hip	\N	\N	\N	metaTaxonomyCode:225XP0019X	\N	\N	\N	\N	\N	f
225XP0200X	225XP0200X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Pediatrics	Occupational therapists provide services to infants, toddlers and children who have or who are at risk for developmental delays or disabilities. Occupational therapy is concerned with a child's ability to participate in daily life activities or "occupations."  Occupational therapists use their unique expertise to help children with social-emotional, physical, cognitive, communication, and adaptive behavioral challenges and to help children to be prepared for and perform important learning and school-related activities and to fulfill their rule as students.  Through an understanding of the impact of disability, illness, and impairment on a child's development, plan, ability to learn new skills, and overall occupational performance, occupational therapists design interventions that promote healthy development, establish needed skills, and/or modify environments, all in support of participation in daily activities.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: new]   Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary board certification for a Pediatric Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 5 years of practice as an occupational therapist.  <li>Minimum of 5,000 hours of experience as an occupational therapist in the certification area in the last 7 calendar years.  <li>Minimum of 500 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 5 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul> AOTA Specialized Knowledge and Skills Paper: Occupational Therapy Practice in the Neonatal Intensive Care Unity (2006); AOTA Fact Sheets: Children and the Tsunami, OT for Children Birth to 3 Years of Age, OT's Role with Autism, OT in Educational Settings Under the Individuals with Disabilities Education Act, Transforming Caseload to Workload in School Based and Early Intervention OT Services, OT in Preschool Settings.	\N	\N	\N	metaTaxonomyCode:225XP0200X	\N	\N	\N	\N	\N	f
225XR0403X	225XR0403X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Occupational Therapist	Driving and Community Mobility	Occupational therapists can optimize and prolong an older driver’s ability to drive safely and ease the transition to other forms of transportation if driving cessation becomes necessary.  By identifying strengths as well as physical or cognitive challenges, occupational therapists can evaluate an individual’s overall ability to operate a vehicle safely and recommend assistive devices or behavioral changes to limit risks.  Occupational therapy practitioners offer a continuum of services related to community mobility, from evaluation of driving performance, through counseling and support for lifestyle changes, to maintaining independence and quality of life.	Source: The Guide to Occupational Therapy Practice, 2nd edition. Bethesda: American Occupational Therapy Association, 2007. [7/1/2008: title changed, definition added, source added]  Additional Resources: The American Occupational Therapy Association (AOTA) does offer voluntary specialty certification for a Driving & Community Mobility Occupational Therapist if the applicant meets the following requirements: <ul> <li>Professional or technical degree or equivalent in occupational therapy.  <li>Certified or licensed by and in good standing with an AOTA recognized credentialing or regulatory body.  <li>Minimum of 2,000 hours of experience as an occupational therapist or occupational therapy assistant.  <li>600 hours of experience delivering occupational therapy services in the certification area to clients (individuals, groups, or populations) in the last 3 calendar years. Service delivery may be paid or voluntary.  <li>Verification of employment. </ul> AOTA Fact Sheets: Older Driver	\N	\N	\N	metaTaxonomyCode:225XR0403X	\N	\N	\N	\N	\N	f
226000000X	226000000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Recreational Therapist Assistant	\N	Recreational Therapist Assistants work in support of or assistant to Recreational Therapists treating patients with disabilities, injuries, and illnesses.  Recreational Therapist Assistants work in a variety of settings providing treatments using recreational activities, including games, sports, and crafts.	Source:  National Uniform Claim Committee, 2015   [1/1/2016: new]	\N	\N	\N	metaTaxonomyCode:226000000X	\N	\N	\N	\N	\N	f
229N00000X	229N00000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Anaplastologist	\N	An anaplastologist is a professional who creates prostheses for the face and body.  Patients treated include those missing anatomy due to cancer, traumatic injury, or birth differences.  Generally, there are no state licensing requirements for anaplastologists.  Certification specific to anaplastology is provided through the Board for Certified Clinical Anaplastology (BCCA) with a credential title of Certified Clinical Anaplastologist (CCA).	Source:  American Anaplastology Association,  www.anaplastology.org. [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:229N00000X	\N	\N	\N	\N	\N	f
227800000X	227800000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	\N	A Certified Respiratory Therapist (CRT) is a an entry level therapist who has passed a standardized written examination administered by the National Board for Respiratory Care (NBRC).  CRTs provide diagnostic testing, therapeutics, monitoring, rehabilitation, and education to patients with disorders of the cardiopulmonary system.  They provide these respiratory care services in all health care facilities and in the home.  A CRT is a graduate of an associate degree program approved by the Commission on Accreditation of Allied Health Educational Programs (CAAHEP) and where applicable, is licensed by the state and is practicing within the scope of the license.	\N	\N	\N	\N	metaTaxonomyCode:227800000X	\N	\N	\N	\N	\N	f
2278C0205X	2278C0205X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	Critical Care	Respiratory emergencies are commonplace in the treatment of critical care patients.  Included in the assessment measurements conducted by the respiratory therapist in the critical care settings are arterial blood gas puncture and analysis, intrarterial monitoring, bedside measurements of lung mechanics, hemodynamic monitoring, and inspired and expired gas measurements.  This is coupled with the initiation and management of mechanical ventilation patients.	\N	\N	\N	\N	metaTaxonomyCode:2278C0205X	\N	\N	\N	\N	\N	f
2278E0002X	2278E0002X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	Emergency Care	The immediate availability of diagnostic and therapeutic cardiopulmonary services in the assessment and management of trauma victims, patients requiring airway management and others requiring emergency care.	\N	\N	\N	\N	metaTaxonomyCode:2278E0002X	\N	\N	\N	\N	\N	f
2278E1000X	2278E1000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	Educational	The focus of patient and family education activities is to promote knowledge of disease process, medical therapy, and self help.  Respiratory therapists are uniquely qualified to provide this service in regard to cardiopulmonary diseases and injury.	\N	\N	\N	\N	metaTaxonomyCode:2278E1000X	\N	\N	\N	\N	\N	f
2278G0305X	2278G0305X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	Geriatric Care	Care of older patients who have age and/or disease related decremental pulmonary changes.  Diagnosis and treatment is very important for this group since chronic lung disease is the major cause of morbidity and mortality among them.  Furthermore, as this segment of the population increases, life expectancy is being extended.	\N	\N	\N	\N	metaTaxonomyCode:2278G0305X	\N	\N	\N	\N	\N	f
2278G1100X	2278G1100X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	General Care	This level of care includes diagnostics testing, therapeutics, monitoring, rehabilitation of patients with disorders of the cardiopulmonary system, as well as, education of the patient and family in regard to those disorders.	\N	\N	\N	\N	metaTaxonomyCode:2278G1100X	\N	\N	\N	\N	\N	f
