2278P1006X	2278P1006X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Certified	Pulmonary Function Technologist	An individual who is trained and qualified to perform pulmonary diagnostic tests.  In the course of conducting these tests, the Pulmonary Function Technologist is able to setup, calibrate, maintain, and ensure the quality assurance of the pulmonary function testing equipment.  In the laboratory, clinical or patient care setting the technologist instructs patients, elicits cooperation, performs procedures, monitors patient response, and evaluates patient performance.  Tests results are calculated, compared with predicted normal ranges, and evaluated for reliability.  The technologist collects clinical history data and evaluates the clinical implications of the test results.	\N	\N	\N	\N	metaTaxonomyCode:2278P1006X	\N	\N	\N	\N	\N	f
