227900000X	227900000X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Registered	\N	A Registered Respiratory Therapist (RRT) is an advanced therapist who has passed standardized written and clinical simulation examinations administered by the National Board for Respiratory Care (NBRC).  In addition, to the certified therapist (CRT) entry level skills, RRTs have advanced education and training in patient assessment, in the development and modification of patient care plans, and in assuring the appropriate utilization of respiratory care resources.  An RRT is a graduate of an associate or baccalaureate degree producing educational programs approved by the Commission on Accreditation of Allied Health Education Programs (CAAHEP) and where applicable, is licensed by the state and is practicing within the scope of that license.	\N	\N	\N	\N	metaTaxonomyCode:227900000X	\N	\N	\N	\N	\N	f
2279C0205X	2279C0205X	Respiratory, Developmental, Rehabilitative and Restorative Service Providers	Respiratory Therapist, Registered	Critical Care	Respiratory emergencies are commonplace in the treatment of critical care patients.  Included in the assessment measurements conducted by the respiratory therapist in the critical care settings are arterial blood gas puncture and analysis, intrarterial monitoring, bedside measurements of lung mechanics, hemodynamic monitoring, and inspired and expired gas measurements.  This is coupled with the initiation and management of mechanical ventilation patients.	\N	\N	\N	\N	metaTaxonomyCode:2279C0205X	\N	\N	\N	\N	\N	f
