235Z00000X	235Z00000X	Speech, Language and Hearing Service Providers	Speech-Language Pathologist	\N	The speech-language pathologist is the professional who engages in clinical services, prevention, advocacy, education, administration, and research in the areas of communication and swallowing across the life span from infancy through geriatrics. Speech-language pathologists address typical and atypical impairments and disorders related to communication and swallowing in the areas of speech sound production, resonance, voice, fluency, language (comprehension and expression), cognition, and feeding and swallowing.	"Scope of Practice in Speech-Language Pathology", American Speech-Language-Hearing Association, 2013.	\N	\N	\N	metaTaxonomyCode:235Z00000X	\N	\N	\N	\N	\N	f
237600000X	237600000X	Speech, Language and Hearing Service Providers	Audiologist-Hearing Aid Fitter	\N	An audiologist/hearing aid fitter is the professional who specializes in evaluating and treating people with hearing loss, conducts a wide variety of tests to determine the exact nature of an individual’s hearing problem, presents a variety of treatment options to patients, dispenses and fits hearing aids, administers tests of balance to evaluate dizziness and provides hearing rehabilitation training. This classification should be used where individuals are licensed as "audiologist-hearing aid fitters" as opposed to states that license individuals as "audiologists".	Source: American Academy of Audiology, 1735 N. Lynn St, Suite 950, Arlington VA 22209, (800)AAA-2336)	\N	\N	\N	metaTaxonomyCode:237600000X	\N	\N	\N	\N	\N	f
237700000X	237700000X	Speech, Language and Hearing Service Providers	Hearing Instrument Specialist	\N	Individuals who test hearing for the selection, adaptation, fitting, adjusting, servicing, and sale of hearing aids. Hearing Instrument Specialist is a designation provided individuals who qualify by the National Hearing Aid Society	\N	\N	\N	\N	metaTaxonomyCode:237700000X	\N	\N	\N	\N	\N	f
242T00000X	242T00000X	Technologists, Technicians & Other Technical Service Providers	Perfusionist	\N	A perfusionist operates extracorporeal circulation and autotransfusion equipment during any medical situation where it is necessary to support or temporarily replace the patient’s circulatory or respiratory function. The perfusionist is knowledgeable concerning the variety of equipment available to perform extracorporeal circulation functions and is responsible, in consultation with the physician, for selecting the appropriate equipment and techniques to be used.	Source:  Health Professions Career and Education Directory, American Medical Association [1/1/2007: new]	\N	\N	\N	metaTaxonomyCode:242T00000X	\N	\N	\N	\N	\N	f
243U00000X	243U00000X	Technologists, Technicians & Other Technical Service Providers	Radiology Practitioner Assistant	\N	A Radiology Practitioner Assistant (RPA) is a health professional certified as a registered radiographer with the American Registry of Radiologic Technologists (ARRT) and, in addition, is credentialed to provide primary radiology health care with radiologist supervision. Radiology Practitioner Assistants are qualified by graduation from an educational program recognized by the Board of Directors of athe Certification Board for Radiology Practitioner Assistants (CBRPA) and certified by the CBRPA. Within the Radiologist/RPA relationship, Radiology Practitioner Assistants exercise autonomy in decision making in the role of a primary caregiver with regard to patient assessment, patient management and in providing a broad range of radiology diagnostic and interventional services. The clinical role of the Radiology Practitioner Assistant includes primary and specialty care in radiology practice settings in rural and urban areas.	Source: Certification Board of Radiology Practitioner Assistants [7/1/2008: new]  Additional Resources: www.cbrpa.org	\N	\N	\N	metaTaxonomyCode:243U00000X	\N	\N	\N	\N	\N	f
246Q00000X	246Q00000X	Technologists, Technicians & Other Technical Service Providers	Spec/Tech, Pathology	\N	(1) An individual educated and trained in clinical chemistry, microbiology or other biological sciences; and in gathering data on the blood, tissues, and fluids in the human body. Tests and procedures performed or supervised center on major areas of hematology, microbiology, immunohematology, immunology, clinical chemistry and urinalysis. Education and certification requires the equivalent of an associate degree and alternative combinations of accredited training and experience. (2) A specially trained individual who works under the direction of a pathologist, other physician, or scientist, and performs specialized chemical, microscopic, and bacteriological tests of human blood, tissue, and fluids. Also known as medical technologists, they perform and supervise tests and procedures in clinical chemistry, immunology, serology, bacteriology, hematology, parasitology, mycology, urinalysis, and blood banking. The work requires the correlation of test results with other data, interpretation of test findings, and exercise of independent judgment. The minimum educational requirement (for one of several certification programs in medical technology) is a baccalaureate degree with appropriate science course requirements, plus a twelve-month, structured, AMA approved medical technology program and an examination; or a baccalaureate degree with appropriate science course requirements and experience.	\N	\N	\N	\N	metaTaxonomyCode:246Q00000X	\N	\N	\N	\N	\N	f
