246ZX2200X	246ZX2200X	Technologists, Technicians & Other Technical Service Providers	Specialist/Technologist, Other	Orthopedic Assistant	An Orthopaedic Assistant is a person who has been trained to work as a physician extender in both clinical and surgical environments. An Orthopaedic Assistant assists with aspects of patient care as determined by the supervising surgeon including, but not limited to, obtaining patient history, assisting with examinations, injections, recording of office notes, and application/adjustment/removal of splints, casts, and other immobilization devices.  Acting as a surgical first assistant for orthopaedic surgery cases includes providing aid in exposure, hemostasis, positioning of the patient, suturing and closure of body planes and skin, application of wound dressings or immobilization devices, and other technical functions that will help the surgeon carry out a safe operation with optimal results for the patient.  An Orthopaedic Assistant may be licensed, registered, or certified depending on the state in which the individual practices.	Source:  American Society of Orthopaedic Assistants (ASOA), 2014 [7/1/2014: new]  Additional Resources: National Board for Certification of Orthopaedic Assistants	\N	\N	\N	metaTaxonomyCode:246ZX2200X	\N	\N	\N	\N	\N	f
