251300000X	251300000X	Agencies	Local Education Agency (LEA)	\N	The term local education agency means a public board of education or other public authority legally constituted within a State to either provide administrative control or direction of, or perform a service function for public schools serving individuals ages 0 – 21 in a state, city, county, township, school district, or other political subdivision including a combination of school districts or counties recognized in a State as an administrative agency for its public schools.  An LEA may provide, or employ professional who provide, services to children included in the Individuals with Disabilities Education Act (IDEA), such services may include, but are not limited to, such medical services as physical, occupational, and speech therapy.	Source: Portions of IDEA Regulations Part B (34 CFR Part 300.18, Assistance to States for the Education of Children with Disabilities)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:251300000X	\N	\N	\N	\N	\N	f
251B00000X	251B00000X	Agencies	Case Management	\N	An organization that is responsible for providing case management services.  The agency provides services which assist an individual in gaining access to needed medical, social, educational, and/or other services.  Case management services may be used to locate, coordinate, and monitor necessary appropriate services.  It may be used to encourage the use of cost-effective medical care by referrals to appropriate providers and to discourage over utilization of costly services.  Case management may also serve to provide necessary coordination of non-medical services such as vocational rehabilitation, education, employment, when the services provided enable the individual to function at the highest level.	Source:  CMS State Medicaid Manual Section 4442.3 [7/1/2006: definition modified]	\N	\N	\N	metaTaxonomyCode:251B00000X	\N	\N	\N	\N	\N	f
251C00000X	251C00000X	Agencies	Day Training, Developmentally Disabled Services	\N	These agencies are authorized to provide day habilitation services to developmentally disabled individuals who live in their homes.  The function of day habilitation is to assist an individual to acquire and maintain those life skills that enable the individual to cope more effectively with the demands of independent living.  Also to raise the level of the individual's physical, mental, social, and vocational functioning.	\N	\N	\N	\N	metaTaxonomyCode:251C00000X	\N	\N	\N	\N	\N	f
251E00000X	251E00000X	Agencies	Home Health	\N	A public agency or private organization, or a subdivision of such an agency or organization, that is primarily engaged in providing skilled nursing services and other therapeutic services, such as physical therapy, speech-language pathology services, or occupational therapy, medical social services, and home health aide services. It has policies established by a professional group associated with the agency or organization (including at least one physician and one registered nurse) to govern the services and provides for supervision of such services by a physician or a registered nurse; maintains clinical records on all patients; is licensed in accordance with State or local law or is approved by the State or local licensing agency as meeting the licensing standards, where applicable; and meets other conditions found by the Secretary of Health and Human Services to be necessary for health and safety.	Source:  CFR42 Chapter IV Part 484,  http://www.access.gpo.gov/nara/cfr/waisidx_99/42cfr484_99.html [7/1/2007: definition added, source added]	\N	\N	\N	metaTaxonomyCode:251E00000X	\N	\N	\N	\N	\N	f
