252Y00000X	252Y00000X	Agencies	Early Intervention Provider Agency	\N	Early intervention services are an effective way to address the needs of infants and toddlers who have developmental delays or disabilities. The services are made available through a federal law known as the Individuals with Disabilities Education Act (IDEA). IDEA provides states and territories with specific requirements for providing early intervention services to infants and toddlers with special needs. In turn, each state and territory develops its own policies for carrying out IDEA and its requirements. Broadly speaking, early intervention services are special services for eligible infants and toddlers and their families. These services are designed to identify and meet children’s needs in five developmental areas. These areas are: physical development, cognitive development, communication, social or emotional development, and adaptive development.	Source: National Dissemination Center for Children with Disabilities [7/1/2007: new]    http://www.nichcy.org/pubs/parent/pa2txt.htm	\N	\N	\N	metaTaxonomyCode:252Y00000X	\N	\N	\N	\N	\N	f
253J00000X	253J00000X	Agencies	Foster Care Agency	\N	A Foster Care Agency is an agency that provides foster care as defined in the Code of Federal Regulations (CFR) as "24-hour substitute care for children outside their own homes." Foster care settings include, but are not limited to, nonrelative foster family homes, relative foster homes (whether payments are being made or not), group homes, emergency shelters, residential facilities, and pre-adoptive homes.	Source: Code Of Federal Regulations, Title 45, Volume 4, Part 1355, Section 57 [1/1/2008: new]	\N	\N	\N	metaTaxonomyCode:253J00000X	\N	\N	\N	\N	\N	f
253Z00000X	253Z00000X	Agencies	In Home Supportive Care	\N	An In Home Supportive Care Agency provides services in the patient’s home with the goal of enabling the patient to remain at home.  The services provided may include personal care services such as hands-on assistance with activities of daily living (ADLs), e.g., eating, bathing, dressing, and bladder and bowel requirements; homemaker services and instrumental activities of daily living (IADLs), e.g., taking medications, shopping for groceries, laundry, housekeeping, and companionship; and/or supervision or cuing so that a person can perform tasks themselves.	Source: National Uniform Claim Committee, 2008 [7/1/2008: new]	\N	\N	\N	metaTaxonomyCode:253Z00000X	\N	\N	\N	\N	\N	f
