311500000X	311500000X	Nursing & Custodial Care Facilities	Alzheimer Center (Dementia Center)	\N	A freestanding facility or special care unit of a long term care facility focusing on patient care of individuals diagnosed with dementia or Alzheimer’s Disease or their related diseases. Six elements of the facility/unit set it apart from other (the rest of the) facilities(y):  Admission of residents with dementia (including those with Alzheimer's disease);  Staff who are specially selected, trained, and supervised;  Activities that are specifically designed for the cognitively impaired;  A marketing of a special care unit in brochures;  A high level of family involvement; and  A physical environment designed to keep residents safe and segregated from other populations.	\N	\N	\N	\N	metaTaxonomyCode:311500000X	\N	\N	\N	\N	\N	f
311Z00000X	311Z00000X	Nursing & Custodial Care Facilities	Custodial Care Facility	\N	A facility providing care that serves to assist an individual in the activities of daily living, such as assistance in walking, getting in and out of bed, bathing, dressing, feeding, and using the toilet, preparation of special diets, and supervision of medication that usually can be self-administered. Custodial care essentially is personal care that does not require the continuing attention of trained medical or paramedical personnel.	Source: Paraphrased from Section 3159 A3 of the Medicare Intermediary Manual.	\N	\N	\N	metaTaxonomyCode:311Z00000X	\N	\N	\N	\N	\N	f
311ZA0620X	311ZA0620X	Nursing & Custodial Care Facilities	Custodial Care Facility	Adult Care Home	A custodial care facility providing supportive and personal care services to disabled and/or elderly individuals who cannot function independently in most areas of activity and need assistance and monitoring to enable them to remain in a home like environment.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:311ZA0620X	\N	\N	\N	\N	\N	f
313M00000X	313M00000X	Nursing & Custodial Care Facilities	Nursing Facility/Intermediate Care Facility	\N	An institution (or a distinct part of an institution) which- (1) is primarily engaged in providing to residents- (A) skilled nursing care and related services for residents who require medical or nursing care, (B) rehabilitation services for the rehabilitation of injured, disabled, or sick persons, or, on a regular basis, health-related care and services to individuals who because of their mental or physical condition require care and services (above the level of room and board) which can be made available to them only through institutional facilities, and is not primarily for the care and treatment of mental diseases; (2) has in effect a transfer agreement with one or more hospitals.	Source: Paraphrased from Section 1919 (a) of the Social Security Act.	\N	\N	\N	metaTaxonomyCode:313M00000X	\N	\N	\N	\N	\N	f
314000000X	314000000X	Nursing & Custodial Care Facilities	Skilled Nursing Facility	\N	(1) A skilled nursing facility is a facility or distinct part of an institution whose primary function is to provide medical, continuous nursing, and other health and social services to patients who are not in an acute phase of illness requiring services in a hospital, but who require primary restorative or skilled nursing services on an inpatient basis above the level of intermediate or custodial care in order to reach a degree of body functioning to permit self care in essential daily living. It meets any licensing or certification standards et forth by the jurisdiction where it is located. A skilled nursing facility may be a freestanding facility or part of a hospital that has been certified by Medicare to admit patients requiring subacute care and rehabilitation; (2) Provides non-acute medical and skilled nursing care services, therapy and social services under the supervision of a licensed registered nurse on a 24-hour basis.	Source: (1) "Glossary of terms used in managed care" Developed by the Managed Care Assembly (MCA) of Medical Group Management Association (MGMA), MGM Journal, September/October 1995, p. 64; (2) AHA Guide, 1996 Annual Survey.	\N	\N	\N	metaTaxonomyCode:314000000X	\N	\N	\N	\N	\N	f
3140N1450X	3140N1450X	Nursing & Custodial Care Facilities	Skilled Nursing Facility	Nursing Care, Pediatric	A nursing care facility designed and staffed for the provision of nursing care and appropriate educational and habilitative/rehabilitative services to children with multiple, complex or profound disabilities that can not be cared for in a less restrictive environment.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3140N1450X	\N	\N	\N	\N	\N	f
315D00000X	315D00000X	Nursing & Custodial Care Facilities	Hospice, Inpatient	\N	A provider organization, or distinct part of the organization, which renders an interdisciplinary program providing palliative care, chiefly medical relief of pain and supporting services, which addresses the emotional, social, financial, and legal needs of terminally ill patients and their families where an institutional care environment is required for the patient.	Source: AHA Guide, American Hospital Association.	\N	\N	\N	metaTaxonomyCode:315D00000X	\N	\N	\N	\N	\N	f
315P00000X	315P00000X	Nursing & Custodial Care Facilities	Intermediate Care Facility, Mentally Retarded	\N	(1) A public institution for care of the mentally retarded or people with related conditions. (2) An institution giving active treatment to mentally retarded or developmentally disabled persons or persons with related conditions. The primary purpose of the institution is to provide health or rehabilitative services to such individuals.	Sources: (1) Lexikon: Dictionary of Health Care Terms, Organizations and Acronyms for the Era of Reform, Joint Commission on Accreditation of Healthcare Organizations, Oakbrook Terrace, IL: 1994, p. 403 (2) Paraphrased from Code of Federal Regulations #42, Public Health, Section 440.150(c).	\N	\N	\N	metaTaxonomyCode:315P00000X	\N	\N	\N	\N	\N	f
