320600000X	320600000X	Residential Treatment Facilities	Residential Treatment Facility, Mental Retardation and/or Developmental Disabilities	\N	A residential facility that provides habilitation services and other care and treatment to adults or children diagnosed with developmental disabilities and/or mental retardation and are not able to live independently.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320600000X	\N	\N	\N	\N	\N	f
320700000X	320700000X	Residential Treatment Facilities	Residential Treatment Facility, Physical Disabilities	\N	A residential facility that provides habilitation services and other care and treatment to adults or children diagnosed with developmental disabilities and/or mental retardation and are not able to live independently.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320700000X	\N	\N	\N	\N	\N	f
320800000X	320800000X	Residential Treatment Facilities	Community Based Residential Treatment Facility, Mental Illness	\N	A home-like residential facility providing psychiatric treatment and psycho/social rehabilitative services to individuals diagnosed with mental illness.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320800000X	\N	\N	\N	\N	\N	f
320900000X	320900000X	Residential Treatment Facilities	Community Based Residential Treatment, Mental Retardation and/or Developmental Disabilities	\N	A home-like residential facility providing habilitation, support and monitoring services to individuals diagnosed with mental retardation and/or developmental disabilities.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:320900000X	\N	\N	\N	\N	\N	f
322D00000X	322D00000X	Residential Treatment Facilities	Residential Treatment Facility, Emotionally Disturbed Children	\N	A provider facility or distinct part of the organization which renders an interdisciplinary program of mental health treatment to individuals under 21 years of age who have persistent dysfunction in major life areas. The dysfunction is of an extent and pervasiveness that requires a protected and highly structured therapeutic environment. These organizations, or distinct part of organizations, exclude those that provide acute psychiatric care, partial hospitalization, group living, therapeutic schooling, primary diagnosis substance abuse disorder treatment, or primary diagnosis mental retardation or developmental disability treatment.	Source: U.S. Department of Defense Regulation 6010.8-R, Chapter 6.	\N	\N	\N	metaTaxonomyCode:322D00000X	\N	\N	\N	\N	\N	f
323P00000X	323P00000X	Residential Treatment Facilities	Psychiatric Residential Treatment Facility	\N	A residential treatment facility (RTF) is a facility or distinct part of a facility that provides to children and adolescents, a total, twenty-four hour, therapeutically planned group living and learning situation where distinct and individualized psychotherapeutic interventions can take place. Residential treatment is a specific level of care to be differentiated from acute, intermediate, and long-term hospital care, when the least restrictive environment is maintained to allow for normalization of the patient’s surroundings. The RTF must be both physically and programmatically distinct if it is a part or subunit of a larger treatment program. An RTF is organized and professionally staffed to provide residential treatment of mental disorders to children and adolescents who have sufficient intellectual potential to respond to active treatment (that is, for whom it can reasonably be assumed that treatment of the mental disorder will result in an improved ability to function outside the RTF) for whom outpatient treatment, partial hospitalization or protected and structured environment is medically or psychologically necessary	Source: Champus Policy manual, Volume II, p. 6010.47M dated 9/12/94. Revision: Definition title revised 7/1/03	\N	\N	\N	metaTaxonomyCode:323P00000X	\N	\N	\N	\N	\N	f
324500000X	324500000X	Residential Treatment Facilities	Substance Abuse Rehabilitation Facility	\N	A facility or distinct part of a facility that provides a 24 hr therapeutically planned living and rehabilitative intervention environment for the treatment of individuals with disorders in the abuse of drugs, alcohol, and other substances.	[7/1/2003: modified title, modified definition]	\N	\N	\N	metaTaxonomyCode:324500000X	\N	\N	\N	\N	\N	f
3245S0500X	3245S0500X	Residential Treatment Facilities	Substance Abuse Rehabilitation Facility	Substance Abuse Treatment, Children	A facility or distinct part of a facility that provides a 24 hr therapeutically planned living and rehabilitative intervention environment for the treatment of children with disorders in the use of drugs, alcohol, and other substances.  Medical and supportive counseling services and education services are included.	[7/1/2003: new]	\N	\N	\N	metaTaxonomyCode:3245S0500X	\N	\N	\N	\N	\N	f
331L00000X	331L00000X	Suppliers	Blood Bank	\N	An institution (organization or distinct part thereof) that performs, or is responsible for the performance of, the collection, processing, storage and/or issuance of human blood and blood components, intended for transfusion. The institution may also collect, process, and/or distribute human tissue, including bone marrow and peripheral blood progenitor cells, intended for transplantation.	Source: American Association of Blood Banks, Standards for Blood Banks and Tranfusion, 17th ed.	\N	\N	\N	metaTaxonomyCode:331L00000X	\N	\N	\N	\N	\N	f
332000000X	332000000X	Suppliers	Military/U.S. Coast Guard Pharmacy	\N	A Department of Defense (DoD) or U.S. Coast Guard entity whose primary function is to store, prepare and dispense pharmaceuticals and other associated items to Uniformed Services beneficiaries.  These pharmacies may be associated with a DoD or U.S. Coast Guard clinic, DoD Hospital or freestanding.  Usually associated with outpatient services.	Source:  TRICARE Management Activity Uniform Business Office User’s Guide [1/1/2005: new; 7/1/2006: modified title, modified definition]	\N	\N	\N	metaTaxonomyCode:332000000X	\N	\N	\N	\N	\N	f
332100000X	332100000X	Suppliers	Department of Veterans Affairs (VA) Pharmacy	\N	Department of Veterans Affairs (VA) Pharmacy means any place under VA jurisdiction where drugs are dispensed and Pharmaceutical Care is provided to enrolled Veterans, by licensed pharmacists. The Pharmacy is reviewed by JCAHO, utilizes the VA hospital’s DEA number, and has a designated NCPDP number. VA facility pharmacies include Inpatient (Institutional), Outpatient, Consolidated Mail Outpatient Pharmacies (CMOPs), Research, Addiction Treatment Centers, Long Term Care and Community Based Outpatient Clinics Pharmacies. The VHA Pharmacy Benefits Management – Strategic Healthcare Group has oversight for professional and practice activities of VA Pharmacies. Each pharmacy is under the direct supervision of a U.S. or U.S. territory licensed pharmacist, and has staffing to meet its designated scope of service.	Source: Pharmacy Benefits Management – Strategic Healthcare Group, Veterans Health Administration, Department of Veterans Affairs  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332100000X	\N	\N	\N	\N	\N	f
332800000X	332800000X	Suppliers	Indian Health Service/Tribal/Urban Indian Health (I/T/U) Pharmacy	\N	An Indian Health Service/Tribal/Urban Indian Health (I/T/U) Pharmacy means a pharmacy operated by the Indian Health Service, an Indian tribe or tribal organization, or an urban Indian organization, all of which are defined in Section 4 of the Indian Health Care Improvement Act, 25 U.S.C. 1603.	Source: The Medicare Prescription Drug, Improvement and Modernization Act of 2003  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332800000X	\N	\N	\N	\N	\N	f
332900000X	332900000X	Suppliers	Non-Pharmacy Dispensing Site	\N	A site other than a pharmacy that dispenses medicinal preparations under the supervision of a physician to patients for self-administration. (e.g. physician offices, ER, Urgent Care Centers, Rural Health Facilities, etc.)	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:332900000X	\N	\N	\N	\N	\N	f
