332S00000X	332S00000X	Suppliers	Hearing  Aid Equipment	\N	The manufacture and/or sale of electronic hearing aids, their component parts, and related products and services on a national basis.	\N	\N	\N	\N	metaTaxonomyCode:332S00000X	\N	\N	\N	\N	\N	f
332U00000X	332U00000X	Suppliers	Home Delivered Meals	\N	Home-delivered meals are those services or activities designed to prepare and deliver one or more meals a day to an individual's residence in order to prevent institutionalization, malnutrition, and feelings of isolation. Component services or activities may include the cost of personnel, equipment, and food; assessment of nutritional and dietary needs; nutritional education and counseling; socialization services; and information and referral.	Source: Code of Federal Regulations #45, Part 96, Appendix A, Uniform Definition of Services.	\N	\N	\N	metaTaxonomyCode:332U00000X	\N	\N	\N	\N	\N	f
333300000X	333300000X	Suppliers	Emergency Response System Companies	\N	A supplier of a personal emergency response system (PERS), which is an electronic device that enables a patient to receive emergency assistance when needed. The PERS is one of two different methodologies of notification: (1) where the patient summons emergency assistance themselves directly through the device or (2) emergency assistance is summoned through secure activation by the caretaker/guardian, which sends the device location to emergency responders.	Source: National Uniform Claim Committee, 2010  [7/1/2010: modified]	\N	\N	\N	metaTaxonomyCode:333300000X	\N	\N	\N	\N	\N	f
333600000X	333600000X	Suppliers	Pharmacy	\N	A facility used by pharmacists for the compounding and dispensing of medicinal preparations and other associated professional and administrative services. A pharmacy is a facility whose primary function is to store, prepare and legally dispense prescription drugs under the professional supervision of a licensed pharmacist. It meets any licensing or certification standards set forth by the jurisdiction where it is located.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC) [1/1/2006: added definition]	\N	\N	\N	metaTaxonomyCode:333600000X	\N	\N	\N	\N	\N	f
3336C0002X	3336C0002X	Suppliers	Pharmacy	Clinic Pharmacy	A pharmacy in a clinic, emergency room or hospital (outpatient) that dispenses medications to patients for self-administration under the supervision of a pharmacist.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336C0002X	\N	\N	\N	\N	\N	f
3336C0003X	3336C0003X	Suppliers	Pharmacy	Community/Retail Pharmacy	A pharmacy where pharmacists store, prepare, and dispense medicinal preparations and/or prescriptions for a local patient population in accordance with federal and state law; counsel patients and caregivers (sometimes independent of the dispensing process); administer vaccinations; and provide other professional services associated with pharmaceutical care such as health screenings, consultative services with other health care providers, collaborative practice, disease state management, and education classes.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336C0003X	\N	\N	\N	\N	\N	f
3336C0004X	3336C0004X	Suppliers	Pharmacy	Compounding Pharmacy	A pharmacy that specializes in the preparation of components into a drug preparation as the result of a Practitioner’s Prescription Drug Order or initiative based on the Practitioner/Patient/Pharmacist relationship in the course of professional practice.  A compounding pharmacy utilizes specialized equipment and specially designed facilities necessary to meet the legal and quality requirements of its scope of compounding practice.	Sources:  NABP Model Practice Act, Appendix C - Good Compounding Practice,  USP <795> and <797>, and Pharmacy Compounding Accreditation Board [7/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336C0004X	\N	\N	\N	\N	\N	f
3336H0001X	3336H0001X	Suppliers	Pharmacy	Home Infusion Therapy Pharmacy	Pharmacy-based, decentralized patient care organization with expertise in USP 797-compliant sterile drug compounding that provides care to patients with acute or chronic conditions generally pertaining to parenteral administration of drugs, biologics and nutritional formulae administered through catheters and/or needles in home and alternate sites. Extensive professional pharmacy services, care coordination, infusion nursing services, supplies and equipment are provided to optimize efficacy and compliance.	Source: National Home Infusion Association  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336H0001X	\N	\N	\N	\N	\N	f
3336I0012X	3336I0012X	Suppliers	Pharmacy	Institutional Pharmacy	A pharmacy in a hospital (inpatient) or institution used by pharmacists for the compounding and delivery of medicinal preparations to be administered to the patient by nursing or other authorized personnel. Institutional Pharmacies also counsel patients and caregivers; administer vaccinations; and provide other professional services associated with pharmaceutical care such as health screenings, consultative services with other health care providers, collaborative practice, disease state management, and education classes.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336I0012X	\N	\N	\N	\N	\N	f
3336L0003X	3336L0003X	Suppliers	Pharmacy	Long Term Care Pharmacy	A pharmacy that dispenses medicinal preparations delivered to patients residing within an intermediate or skilled nursing facility, including intermediate care facilities for mentally retarded, hospice, assisted living facilities, group homes, and other forms of congregate living arrangements.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336L0003X	\N	\N	\N	\N	\N	f
3336M0002X	3336M0002X	Suppliers	Pharmacy	Mail Order Pharmacy	A pharmacy where pharmacists compound or dispense prescriptions or other medications in accordance with federal and state law, using common carriers to deliver the medications to patient or their caregivers. Mail order pharmacies counsel patients and caregivers (sometimes independent of the dispensing process) through telephone or email contact and provide other professional services associated with pharmaceutical care appropriate to the setting. Mail order pharmacies are licensed as a Mail Order Pharmacy in the state where they are located and may also be licensed or registered as nonresident pharmacies in other states.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336M0002X	\N	\N	\N	\N	\N	f
3336M0003X	3336M0003X	Suppliers	Pharmacy	Managed Care Organization Pharmacy	A pharmacy owned by a managed care organization (MCO) used by pharmacists for the compounding and dispensing of medicinal preparations to that MCO’s covered members only.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336M0003X	\N	\N	\N	\N	\N	f
3336N0007X	3336N0007X	Suppliers	Pharmacy	Nuclear Pharmacy	A pharmacy dedicated to the compounding and dispensing of radioactive materials for use in nuclear imaging and nuclear medical procedures.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336N0007X	\N	\N	\N	\N	\N	f
3336S0011X	3336S0011X	Suppliers	Pharmacy	Specialty Pharmacy	A pharmacy that dispenses generally low volume and high cost medicinal preparations to patients who are undergoing intensive therapies for illnesses that are generally chronic, complex and potentially life threatening. Often these therapies require specialized delivery and administration.	Source: Developed by National Council for Prescription Drug Programs (NCPDP), National Home Infusion Association (NHIA), and Pharmacist Services Technical Advisory Coalition (PSTAC)  [1/1/2006: new]	\N	\N	\N	metaTaxonomyCode:3336S0011X	\N	\N	\N	\N	\N	f
335E00000X	335E00000X	Suppliers	Prosthetic/Orthotic Supplier	\N	An organization that provides prosthetic and orthotic care which may include, but is not limited to, patient evaluation, prosthesis or orthosis design, fabrication, fitting and modification to treat limb loss for purposes of restoring physiological function and/or cosmesis or to treat a neuromusculoskeletal disorder or acquired condition.	Source:  American Board for Certification in Orthotics, Prosthetics, and Pedorthics, Inc. [7/1/2010: modified, 7/1/2013: modified]  Additional Resources:  American Board for Certification in Orthotics, Prosthetics and Pedorthics, Inc., www.abcop.org and Board of Certification/Accreditation, International, www.bocusa.org.	\N	\N	\N	metaTaxonomyCode:335E00000X	\N	\N	\N	\N	\N	f
335G00000X	335G00000X	Suppliers	Medical Foods Supplier	\N	A supplier of special replacement foods for clients with errors of metabolism that prohibit them from eating a regular diet.   Medical foods are lacking in the compounds which cause complications of the metabolic disorder, and are not generally available in grocery stores, health food stores, or pharmacies.	Source:  The Children with Special Healthcare Needs (CSHCN) Services Program, a program of the Texas Department of State Health Services	\N	\N	\N	metaTaxonomyCode:335G00000X	\N	\N	\N	\N	\N	f
335U00000X	335U00000X	Suppliers	Organ Procurement Organization	\N	A federally designated organization that works with hospital personnel in retrieval of organs for transplantation. The federal government designates an OPO’s service area and the hospitals with which an OPO is to establish working relationships.	\N	\N	\N	\N	metaTaxonomyCode:335U00000X	\N	\N	\N	\N	\N	f
335V00000X	335V00000X	Suppliers	Portable X-ray and/or Other Portable Diagnostic Imaging Supplier	\N	A supplier that provides one or more of the following portable services, including but not limited to, x-ray, electrocardiogram (EKG), long-term EKG (Holter Monitor), bone densitometry, sonography, and other imaging services in accordance with all state and federal requirements, under the general supervision of a qualified physician.  All necessary resources are transported to the patient's location where the services are performed.	Source: National Uniform Claim Committee, 2015 [1/1/2016: title and definition modified]	\N	\N	\N	metaTaxonomyCode:335V00000X	\N	\N	\N	\N	\N	f
